(95, 25, 'Diasumsikan bahwa data harga yang diberikan akurat dan representatif untuk pasar di Kabupaten Mempawah.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(96, 26, 'Diasumsikan bahwa cuaca di sentra produksi utama (misalnya Sambas) berkorelasi langsung dengan pasokan Cabai Merah Keriting ke Mempawah.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(97, 26, 'Diasumsikan tidak ada Hari Besar Keagamaan Nasional (HBKN) terdekat yang secara signifikan memengaruhi pola permintaan.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
