(99, 27, 'Asumsi bahwa data harga yang tersedia cukup representatif untuk pasar Bawang Merah di Kabupaten Mempawah.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(100, 28, 'Diasumsikan Udang Basah,1 kg sebagai komoditas \'PENTING\' memiliki karakteristik volatilitas yang mendekati \'Komoditas Volatil\' dalam klasifikasi harga.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
