INSERT INTO `analisis_data_based_alerts` (`id`, `analisis_harga_id`, `content`, `created_at`, `updated_at`) VALUES
(17, 1, 'Penurunan harga mingguan (-20.00%) dan bulanan (-37.50%) yang sangat signifikan berpotensi mengindikasikan tekanan pasokan berlebih di pasar atau penurunan permintaan yang tajam.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(18, 1, 'Harga saat ini berada di level yang signifikan lebih rendah dari rata-rata historis 90 hari, mendekati batas harga terendah.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(19, 1, 'Tingkat volatilitas yang tinggi (CV 26.83%) mengindikasikan bahwa harga dapat berfluktuasi secara besar dalam waktu singkat.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(20, 2, 'Penurunan harga mingguan (-6.45%) dan bulanan (-9.38%) yang signifikan untuk komoditas penting.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(21, 2, 'Harga saat ini mencapai level terendah dalam 90 hari terakhir (Rp 29.000).', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(22, 3, 'Penurunan harga mingguan sebesar -3.33% melebihi batas perubahan normal untuk komoditas pokok, meskipun harga masih di atas rata-rata 90 hari.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(23, 3, 'Meskipun volatilitas historis rendah, penurunan mingguan ini perlu dipantau untuk melihat apakah ini adalah koreksi harga atau awal tren penurunan baru.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(24, 4, 'Penurunan harga mingguan sebesar -3.33% melewati ambang batas normal fluktuasi mingguan (< Â±2%) untuk komoditas pokok, memerlukan pemantauan lebih lanjut.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(25, 5, 'Pola harga yang stagnan pada 0.00% perubahan untuk harian, mingguan, dan bulanan mengindikasikan stabilitas harga yang tinggi, namun juga perlu dipastikan bahwa data yang tercatat akurat dan merepresentasikan kondisi pasar riil.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(26, 6, 'Peningkatan harga mingguan yang mencapai 55.56% mengindikasikan kondisi harga \'EKSTREM\' yang memerlukan perhatian segera.', '2025-09-19 07:20:28', '2025-09-19 07:20:28'),
(27, 6, 'Posisi harga saat ini yang 39.69% di atas rata-rata 90 hari menandakan adanya tekanan harga yang tidak normal dan berpotensi memicu inflasi.', '2025-09-19 07:20:28', '2025-09-19 07:20:28'),
(28, 6, 'Harga saat ini (Rp 70.000) mendekati harga tertinggi historis (Rp 80.000), menunjukkan potensi untuk mendekati atau melampaui rekor baru.', '2025-09-19 07:20:28', '2025-09-19 07:20:28'),
(29, 7, 'Kenaikan harga mingguan sebesar 25.00% mendekati ambang batas kategori ekstrem, menunjukkan tekanan inflasi yang signifikan dalam waktu singkat.', '2025-09-19 07:20:28', '2025-09-19 07:20:28'),
(30, 7, 'Laju kenaikan harga yang cepat perlu diwaspadai agar tidak memicu lonjakan harga yang lebih tinggi dan berpotensi membebani daya beli masyarakat.', '2025-09-19 07:20:28', '2025-09-19 07:20:28'),
(31, 8, 'Kenaikan harga mingguan 22.22% jauh melampaui ambang batas normal untuk komoditas volatil (7-15%), mengindikasikan kondisi bergejolak yang signifikan.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(32, 8, 'Harga saat ini yang 11.24% di atas rata-rata 90 hari menunjukkan potensi tekanan inflasi pada komoditas ini.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(33, 9, 'Penurunan harga mingguan -20.00% melebihi batas atas kondisi \'BERGEJOLAK\' dan mendekati kondisi \'EKSTREM\' untuk komoditas volatil, mengindikasikan tekanan pasar yang sangat signifikan.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(34, 9, 'Harga saat ini yang 16.86% di bawah rata-rata 90 hari menunjukkan anomali yang perlu perhatian serius, berpotensi menandakan kelebihan pasokan atau penurunan permintaan yang drastis.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(35, 10, 'Kenaikan harga 20.00% dalam seminggu dan sebulan terakhir secara signifikan melebihi ambang batas fluktuasi normal untuk komoditas \'Penting\' dan menempatkannya dalam kondisi \'BERGEJOLAK\'.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(36, 10, 'Harga saat ini mencapai Rp 60.000, yang merupakan titik tertinggi dalam 90 hari terakhir, mengindikasikan potensi \'ceiling price\' atau resistensi.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(98, 24, 'Kenaikan harga mingguan 55.56% jauh melebihi ambang batas ekstrem (>25%) untuk komoditas volatil.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(99, 24, 'Harga saat ini mendekati harga tertinggi 90 hari, menunjukkan tekanan harga yang kuat dan risiko tinggi.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(100, 24, 'Indeks volatilitas 68.13 menunjukkan fluktuasi harga yang sangat tidak normal.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(101, 25, 'Laju kenaikan harga mingguan 25.00% menempatkan Cabai Rawit Merah di ambang kondisi harga \'EKSTREM\' untuk komoditas volatil, memerlukan perhatian serius.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(102, 25, 'Kenaikan harga terjadi mendadak setelah periode stabil, mengindikasikan adanya pemicu *shock* yang perlu diinvestigasi.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(103, 26, 'Harga Cabai Merah Keriting telah mencapai batas atas HAP, mengindikasikan urgensi untuk pemantauan ketat dan potensi intervensi.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(104, 26, 'Perubahan harga mingguan yang signifikan (>20%) menunjukkan kondisi pasar yang bergejolak.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(105, 26, 'Volatilitas yang tinggi mengindikasikan risiko pergerakan harga yang cepat dan tidak terduga.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(106, 27, 'Penurunan harga mingguan -20.00% tergolong BERGEJOLAK untuk komoditas volatil, menunjukkan dinamika pasar yang perlu diawasi.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(107, 27, 'Indeks volatilitas yang sangat tinggi (92.13) mengindikasikan potensi perubahan harga yang mendadak, meskipun saat ini sedang tren turun.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(108, 27, 'Posisi harga saat ini (-16.86% di bawah rata-rata) menunjukkan pergeseran signifikan dari kondisi normal 90 hari terakhir.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(109, 28, 'Peringatan dini: Kenaikan harga Udang Basah,1 kg sebesar 20.00% dalam seminggu menunjukkan potensi gejolak harga yang memerlukan perhatian serius.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(110, 28, 'Indeks volatilitas yang tinggi (90.91) mengindikasikan pasar Udang Basah,1 kg sedang sangat sensitif terhadap perubahan pasokan atau permintaan.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(133, 29, 'Peringatan dini terhadap potensi lonjakan inflasi pangan lokal akibat kenaikan harga Cabai Merah Besar yang ekstrem.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(134, 29, 'Potensi ketidakseimbangan pasokan dan permintaan yang signifikan di pasar.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(135, 30, 'Harga Cabai Rawit Merah menunjukkan kenaikan signifikan dan bergejolak (25% mingguan), meskipun masih berada dalam rentang HAP. Pergerakan cepat ini membutuhkan perhatian serius.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(136, 30, 'Indeks Volatilitas yang mencapai 52.32 mengindikasikan kondisi pasar yang kurang stabil dan rentan terhadap gejolak lebih lanjut.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(137, 31, 'Tingkat kenaikan harga mingguan yang signifikan (22.22%) untuk komoditas volatil, menunjukkan tekanan inflasi.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(138, 31, 'Harga saat ini (Rp 55.000) berada tepat di batas atas Harga Acuan Penjualan (HAP), mengindikasikan bahwa harga sudah mencapai level yang perlu diwaspadai.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(139, 31, 'Indeks volatilitas yang tinggi (70.54) menunjukkan pasar sangat rentan terhadap guncangan harga.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(140, 32, 'Harga saat ini berada secara signifikan di bawah rata-rata harga 90 hari, menunjukkan pergeseran ke rezim harga yang lebih rendah.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(141, 32, 'Volatilitas harga yang sangat tinggi (Indeks 91.36) mengindikasikan sensitivitas pasar yang ekstrem terhadap perubahan pasokan atau permintaan.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(142, 33, 'Perubahan harga mingguan 20.00% menunjukkan lonjakan harga yang signifikan dan berada pada level \'BERGEJOLAK\'.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(143, 33, 'Indeks volatilitas 90.70 mengindikasikan risiko fluktuasi harga yang sangat tinggi dan mendekati level ekstrem historis.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(155, 34, 'Kenaikan harga mingguan yang signifikan (25%) setelah periode harga rendah menunjukkan pembalikan tren yang perlu diwaspadai, berpotensi memicu kenaikan lebih lanjut.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(156, 34, 'Indeks volatilitas yang mendekati ambang batas ekstrem mengindikasikan pasar Cabai Merah Besar sangat rentan terhadap guncangan dan fluktuasi harga yang cepat.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(157, 35, 'Harga Cabai Rawit Merah telah melampaui batas atas HAP.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(158, 35, 'Kenaikan harga mingguan sebesar 20.00% menunjukkan tekanan inflasi yang kuat.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(159, 35, 'Indeks volatilitas yang sangat tinggi (98.69) mengindikasikan risiko pergerakan harga yang tidak terduga dan signifikan.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(160, 36, 'Harga Bawang Merah berada di level ekstrem, jauh di atas Harga Acuan Penjualan (HAP).', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(161, 36, 'Kenaikan harga bulanan yang sangat signifikan (33.33%) menunjukkan tekanan pasar yang kuat.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(162, 37, 'Harga Cabai Merah Keriting saat ini berada di batas atas HAP (Rp 55.000).', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(163, 37, 'Tingkat volatilitas harga sangat tinggi (Indeks Volatilitas 95.89), mendekati ambang batas ekstrem historis.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(164, 37, 'Terjadi kenaikan harga signifikan +10% dalam seminggu dan +83.33% dalam sebulan.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(165, 38, 'Meskipun harga saat ini stabil, penurunan 5.00% dalam sebulan perlu dipantau agar tidak berlanjut hingga merugikan peternak secara signifikan.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(174, 39, 'Harga berada di bawah HAP, perlu dimonitor dampak pada kesejahteraan peternak dan keberlanjutan produksi.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(175, 39, 'Perubahan bulanan sebesar -5.00% mengindikasikan tekanan harga sebelumnya, meskipun saat ini stabil.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(176, 40, 'Harga telah melewati HAP sebesar Rp 30.000.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(177, 40, 'Volatilitas harga tergolong tinggi, mendekati ambang batas historis.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(178, 40, 'Kenaikan mingguan 3.33% menunjukkan tren yang perlu diwaspadai.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(179, 41, 'Tidak ada peringatan berbasis data yang signifikan saat ini karena stabilitas harga yang tinggi. Kondisi cenderung aman.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(180, 42, 'Berdasarkan data hingga Juli 2025, harga Bawang Merah berada pada level ekstrem di atas HAP dan rata-rata 90 hari.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(181, 42, 'Volatilitas harga pada Juli 2025 melebihi ambang batas historis yang dianggap ekstrem.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(182, 43, 'Harga Gula Pasir Curah telah mencapai titik terendah dalam 90 hari terakhir dan menunjukkan stabilitas penuh tanpa perubahan harga dalam seminggu.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(183, 44, 'Harga telah mencapai titik terendah dalam 90 hari terakhir (Rp 16.000).', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(184, 44, 'Penurunan harga mingguan -5.88% sangat signifikan untuk komoditas pokok.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(185, 44, 'Indeks volatilitas (64.74) menunjukkan bahwa fluktuasi harga saat ini mendekati ambang batas ekstrem historis, mengindikasikan potensi pergerakan harga yang cepat.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(186, 45, 'Harga telah mencapai Harga Acuan Penjualan (HAP), yang menandakan batas atas harga wajar dan membutuhkan perhatian serius agar tidak melampaui batas.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(187, 45, 'Volatilitas harga telah meningkat secara signifikan dibandingkan historis, mendekati ambang batas ekstrem, mengindikasikan pasar yang rentan terhadap guncangan.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(188, 46, 'Terjadi penurunan harga signifikan sebesar 3.45% dalam satu hari setelah periode stabil, perlu dipantau apakah ini merupakan tren baru atau fluktuasi sesaat.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(189, 47, 'Harga Telur Ayam Ras saat ini Rp 28.000, mencapai titik terendah dalam 90 hari terakhir.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(190, 47, 'Harga berada di bawah Harga Acuan Penjualan (HAP) Rp 30.000, menandakan potensi tekanan pada peternak.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(191, 47, 'Indeks volatilitas harga mencapai 88.07, menunjukkan potensi pasar yang rentan terhadap perubahan mendadak, meskipun saat ini trennya menurun.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(192, 48, 'Harga Beras Cap Anggrek (Medium) telah mencapai titik terendah dalam 90 hari terakhir, menandakan potensi perubahan fundamental di pasar.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(193, 48, 'Penurunan harga mingguan sebesar -3.45% mengindikasikan pergerakan yang signifikan di luar rentang stabil yang biasa untuk komoditas pokok.', '2025-09-25 03:12:12', '2025-09-25 03:12:12');
INSERT INTO `analisis_data_constraints` (`id`, `analisis_harga_id`, `content`, `created_at`, `updated_at`) VALUES
(21, 1, 'Analisis ini didasarkan secara eksklusif pada data harga dan statistik historis 90 hari yang disediakan.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(22, 1, 'Ketiadaan data volume transaksi atau stok aktual membatasi analisis lebih dalam mengenai dinamika penawaran dan permintaan.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(23, 2, 'Analisis tidak mencakup data volume penjualan atau pasokan riil.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(24, 2, 'Tidak ada informasi mengenai harga di tingkat produsen atau faktor biaya produksi saat ini.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(25, 3, 'Analisis ini terbatas pada data harga yang tersedia dan statistik turunan (rata-rata, volatilitas, perubahan).', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(26, 3, 'Tidak ada data mengenai volume penjualan, stok komoditas, atau biaya produksi yang dapat memberikan gambaran lebih lengkap.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(27, 4, 'Analisis tidak mencakup data real-time mengenai kondisi pasokan dan permintaan di tingkat produsen atau distributor.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(28, 4, 'Tidak tersedia data historis jangka panjang (misalnya, tahunan) untuk identifikasi pola musiman yang lebih mendalam.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(29, 5, 'Keterbatasan data pada faktor-faktor eksternal seperti pasokan, permintaan, dan biaya distribusi.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(30, 5, 'Data historis harga yang lebih panjang dari 90 hari tidak tersedia untuk analisis tren jangka panjang.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(31, 5, 'Tidak tersedia data volume transaksi atau stok di pasar.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(32, 6, 'Analisis tidak mencakup data volume transaksi atau stok yang dapat memberikan gambaran lebih lengkap tentang dinamika penawaran dan permintaan.', '2025-09-19 07:20:28', '2025-09-19 07:20:28'),
(33, 6, 'Data perubahan harian 0.00% pada tanggal analisis dapat mempengaruhi interpretasi pergerakan harga intra-minggu jika tidak ada transaksi atau update harga yang dilaporkan pada hari tersebut.', '2025-09-19 07:20:28', '2025-09-19 07:20:28'),
(34, 7, 'Analisis ini terbatas pada data harga yang tersedia dan tidak mencakup informasi mengenai volume pasokan, permintaan aktual, atau biaya produksi.', '2025-09-19 07:20:28', '2025-09-19 07:20:28'),
(35, 7, 'Tidak ada data spesifik mengenai penyebab langsung kenaikan harga (misalnya, gangguan distribusi, perubahan iklim ekstrem di daerah sentra, atau kejadian mendadak lainnya).', '2025-09-19 07:20:28', '2025-09-19 07:20:28'),
(36, 8, 'Analisis ini terbatas pada data harga yang tersedia dan tidak memiliki informasi detail mengenai volume transaksi, stok di pasar, atau biaya produksi.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(37, 8, 'Data harian yang menunjukkan 0.00% perubahan mungkin menyembunyikan fluktuasi intraday atau tidak sepenuhnya mencerminkan dinamika pasar yang sebenarnya pada hari tersebut.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(38, 9, 'Analisis ini didasarkan murni pada data harga yang disediakan dan tidak mencakup data volume pasokan/permintaan.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(39, 9, 'Keterbatasan pada rentang waktu data (90 hari) membatasi analisis pola musiman jangka panjang yang mungkin relevan.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(40, 9, 'Tidak ada data mengenai struktur biaya atau margin keuntungan pedagang dan petani.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(41, 10, 'Analisis ini tidak memiliki data spesifik mengenai volume pasokan, permintaan aktual, atau faktor-faktor non-harga lainnya yang dapat menjelaskan lonjakan harga.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(42, 10, 'Data historis untuk analisis pola hanya tersedia untuk periode 90 hari.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(103, 24, 'Analisis ini terbatas pada data harga satu komoditas di satu titik pasar dan periode waktu yang terbatas.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(104, 24, 'Tidak adanya HET/HAP membatasi kerangka acuan untuk intervensi harga secara langsung dan penilaian kepatuhan.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(105, 24, 'Data cuaca yang dirangkum untuk 7 hari, sementara memberikan konteks, tidak cukup detail (misalnya, per jam/harian per kecamatan) untuk analisis kausalitas yang sangat presisi.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(106, 25, 'Analisis ini hanya didasarkan pada data harga dari satu titik atau agregasi, tanpa informasi spesifik mengenai volume transaksi atau stok aktual.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(107, 25, 'Data harga historis 90 hari memberikan gambaran jangka pendek hingga menengah, namun mungkin tidak sepenuhnya menangkap siklus harga jangka panjang yang lebih luas.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(108, 26, 'Analisis ini hanya berdasarkan data harga dari Pasar (Sebukit Rama) dan data cuaca regional, tanpa data stok riil di gudang distributor atau tingkat petani.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(109, 26, 'Keterbatasan data historis harga yang sangat rinci (misal, harian selama beberapa tahun) dapat membatasi kedalaman analisis musiman yang lebih kompleks.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(110, 27, 'Analisis ini terbatas pada data harga eceran dan tidak menyertakan data biaya produksi di tingkat petani, margin keuntungan di sepanjang rantai pasok, atau volume pasokan dan permintaan aktual.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(111, 27, 'Data historis cuaca jangka panjang tidak disertakan untuk analisis pola cuaca musiman secara lebih mendalam.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(112, 28, 'Analisis ini terbatas pada data harga pasar dan statistik historis yang tersedia, tanpa data spesifik produksi atau rantai pasok yang terperinci.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(113, 28, 'Tidak adanya Harga Eceran Tertinggi (HET) atau Harga Acuan Penjualan (HAP) membatasi penilaian status harga terhadap kebijakan pemerintah.', '2025-09-21 15:57:08', '2025-09-21 15:57:08'),
(138, 29, 'Analisis ini tidak mencakup data harga dari tingkat produsen atau distributor, sehingga sulit untuk mengidentifikasi secara pasti di mana titik gangguan rantai pasok terjadi.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(139, 29, 'Keterbatasan data historis jangka panjang membatasi analisis tren musiman yang lebih mendalam.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(140, 30, 'Analisis ini tidak menyertakan data volume transaksi, data stok riil di gudang, atau data biaya operasional pedagang, yang dapat memberikan gambaran lebih lengkap tentang dinamika pasar.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(141, 30, 'Ketersediaan data dari seluruh rantai pasok (petani, pengumpul, distributor, pengecer) tidak lengkap dalam analisis ini.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(142, 31, 'Analisis ini terbatas pada data harga pasar eceran dan tidak mencakup data volume pasokan, stok di berbagai tingkatan rantai pasok, maupun detail biaya produksi dan distribusi yang komprehensif.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(143, 31, 'Ketiadaan data harga historis yang lebih rinci untuk perbandingan langsung dengan periode musim pancaroba sebelumnya dapat membatasi kedalaman analisis.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(144, 32, 'Analisis ini terbatas pada data harga dari satu pasar dan tidak mencakup data biaya produksi petani secara spesifik.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(145, 32, 'Informasi mengenai stok di tingkat distributor atau volume pasokan dari sentra produksi tidak tersedia secara langsung dalam data yang diberikan.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(146, 32, 'Keterbatasan data historis yang spesifik mengenai reaksi harga Bawang Merah terhadap kondisi cuaca pancaroba di wilayah Mempawah dan sekitarnya.', '2025-09-22 06:55:10', '2025-09-22 06:55:10'),
(147, 33, 'Analisis ini hanya berdasarkan data harga dari satu pasar (Pasar Sebukit Rama) di Kabupaten Mempawah.', '2025-09-22 06:55:11', '2025-09-22 06:55:11'),
(148, 33, 'Tidak tersedianya data HET/HAP membatasi penilaian kepatuhan harga dan potensi intervensi regulatif.', '2025-09-22 06:55:11', '2025-09-22 06:55:11'),
(149, 33, 'Data cuaca historis yang lebih rinci dan tersegmentasi dari sentra produksi akan memberikan analisis kausal yang lebih kuat.', '2025-09-22 06:55:11', '2025-09-22 06:55:11'),
(160, 34, 'Analisis terbatas pada data harga dari satu sumber pasar dan tidak mencakup seluruh rantai pasok dari petani hingga konsumen akhir, yang dapat menyembunyikan dinamika harga di tingkat yang berbeda.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(161, 34, 'Ketiadaan data Harga Acuan Penjualan (HAP) atau Harga Eceran Tertinggi (HET) membatasi kemampuan untuk menilai apakah harga saat ini berada di ambang batas kewajaran kebijakan.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(162, 35, 'Analisis ini terbatas pada data harga 90 hari terakhir dan ringkasan cuaca 7 hari terakhir di tingkat kabupaten/provinsi.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(163, 35, 'Tidak memiliki data real-time mengenai kondisi panen spesifik di seluruh sentra produksi yang menyuplai Kabupaten Mempawah.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(164, 35, 'Tidak ada data mengenai stok persediaan di luar pasar eceran.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(165, 36, 'Analisis ini terbatas pada data harga yang tersedia hingga 18 Juli 2025 dan tidak mencakup data volume produksi atau distribusi secara spesifik.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(166, 36, 'Konteks cuaca regional digunakan sebagai indikasi umum dan tidak secara langsung mencerminkan kondisi di semua sentra produksi Bawang Merah pemasok Mempawah.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(167, 37, 'Analisis ini terbatas pada data harga pasar lokal yang tersedia dan ringkasan cuaca 7 hari terakhir.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(168, 37, 'Ketersediaan data rinci mengenai stok di berbagai tingkatan rantai pasok terbatas.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(169, 38, 'Analisis ini didasarkan pada data harga hingga 17 Juli 2025 dan tidak mencakup faktor-faktor eksternal non-harga secara eksplisit (selain konteks musiman).', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(170, 38, 'Ketiadaan data cuaca aktual 7 hari terakhir membatasi kemampuan untuk membuat korelasi langsung antara kondisi iklim dan pergerakan harga.', '2025-09-23 07:32:38', '2025-09-23 07:32:38'),
(182, 39, 'Analisis ini hanya berdasarkan data harga dari Pasar Sebukit Rama di Kabupaten Mempawah, dan mungkin tidak merepresentasikan seluruh pasar di wilayah tersebut.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(183, 39, 'Data cuaca aktual 7 hari terakhir tidak tersedia, sehingga tidak dapat diintegrasikan dalam analisis penyebab pergerakan harga.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(184, 39, 'Tidak ada data volume transaksi atau stok di tingkat produsen/distributor yang dapat memperkaya analisis pasokan dan permintaan.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(185, 40, 'Analisis hanya berdasarkan data Pasar Sebukit Rama.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(186, 40, 'Tidak ada data real-time mengenai biaya produksi atau kondisi peternakan lokal.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(187, 40, 'Data cuaca aktual hanya tersedia untuk 7 hari terakhir.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(188, 41, 'Analisis terbatas pada data harga hingga 18 Juli 2025, sehingga tidak mencerminkan dinamika pasar yang mungkin terjadi setelah tanggal tersebut.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(189, 41, 'Data harga berasal dari satu titik pasar (asumsi: Pasar Sebukit Rama) dan mungkin tidak sepenuhnya merepresentasikan kondisi di seluruh wilayah Kabupaten Mempawah.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(190, 42, 'Keterbatasan data: Analisis ini didasarkan pada data harga yang sudah kadaluarsa (hingga 18 Juli 2025), yang mungkin tidak sepenuhnya merefleksikan kondisi pasar pada 24 September 2025.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(191, 42, 'Ketiadaan data produksi dan stok aktual dari daerah sentra pasokan Bawang Merah saat ini membatasi analisis sisi pasokan pada tingkat hipotesis.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(192, 43, 'Analisis ini hanya berdasarkan data harga dari Pasar Sebukit Rama di Kabupaten Mempawah.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(193, 43, 'Data cuaca aktual 7 hari terakhir tidak tersedia, sehingga asumsi kondisi pancaroba hanya berdasarkan konteks musiman umum.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(194, 43, 'Tidak adanya HET/HAP membatasi analisis perbandingan dengan harga acuan pemerintah.', '2025-09-24 05:02:45', '2025-09-24 05:02:45'),
(195, 44, 'Analisis ini terbatas pada data harga eceran mingguan dan bulanan, tanpa data volume transaksi.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(196, 44, 'Tidak ada informasi HET atau HAP yang spesifik untuk Beras Cap Madu Tupai (Premium) dalam data yang disediakan, sehingga penilaian urgensi hanya berdasarkan perbandingan historis dan dinamika pasar.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(197, 44, 'Data cuaca regional memberikan konteks namun tidak langsung menghubungkan ke dampak spesifik terhadap produksi beras di Mempawah.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(198, 45, 'Analisis ini hanya berdasarkan data harga dari titik penjualan akhir di Kabupaten Mempawah.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(199, 45, 'Tidak ada data volume transaksi atau stok yang disertakan untuk analisis pasokan dan permintaan yang lebih mendalam.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(200, 45, 'Data cuaca aktual 7 hari terakhir tidak tersedia, sehingga asumsi dampak cuaca didasarkan pada konteks musiman umum.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(201, 46, 'Analisis ini tidak mencakup data harga di tingkat produsen atau distributor.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(202, 46, 'Tidak ada data spesifik mengenai stok beras di Kabupaten Mempawah pada saat ini.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(203, 46, 'Tidak ada informasi mengenai harga acuan (HET/HAP) untuk komoditas ini.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(204, 47, 'Analisis ini hanya didasarkan pada data harga yang tersedia dan tidak mencakup data biaya produksi, volume distribusi, atau data dari pasar lain di luar Pasar Sebukit Rama (jika diasumsikan hanya dari satu pasar).', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(205, 47, 'Data konteks cuaca aktual selama 7 hari terakhir tidak tersedia, sehingga dampak spesifik cuaca terhadap kondisi pasar tidak dapat dimasukkan dalam analisis.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(206, 48, 'Analisis ini terbatas pada data harga dari Kabupaten Mempawah dan tidak mencakup seluruh pasar regional.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(207, 48, 'Tidak tersedia data Harga Eceran Tertinggi (HET) atau Harga Acuan Penjualan (HAP) untuk Beras Cap Anggrek (Medium), sehingga tidak dapat dibandingkan dengan patokan harga pemerintah.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(208, 48, 'Data volume transaksi atau stok beras aktual di pasar tidak tersedia, sehingga asumsi tentang pasokan harus didasarkan pada pergerakan harga.', '2025-09-25 03:12:12', '2025-09-25 03:12:12');
INSERT INTO `analisis_data_quality_notes` (`id`, `analisis_harga_id`, `content`, `created_at`, `updated_at`) VALUES
(19, 1, 'Data harga yang tersedia cukup detail untuk periode 90 hari terakhir, memberikan basis yang kuat untuk analisis statistik pergerakan harga.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(20, 2, 'Data yang tersedia cukup komprehensif untuk analisis tren jangka pendek dan volatilitas historis.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(21, 3, 'Data harga menunjukkan konsistensi untuk periode yang dianalisis.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(22, 3, 'Data tidak mencakup volume transaksi atau informasi pasokan/permintaan secara langsung.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(23, 4, 'Data harga yang tersedia cukup lengkap untuk periode 90 hari terakhir dan menunjukkan konsistensi internal.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
(24, 5, 'Konsistensi data harga pada angka 0.00% perubahan untuk harian, mingguan, dan bulanan adalah anomali statistik yang jarang terjadi dan memerlukan konfirmasi akurasi input data.', '2025-09-19 05:02:58', '2025-09-19 05:02:58'),
