INSERT INTO `analisis_harga` (`id`, `komoditas_id`, `commodity_category`, `analysis_date`, `data_freshness`, `analysis_confidence`, `condition_level`, `volatility_index`, `trend_direction`, `statistical_significance`, `key_observation`, `current_position`, `price_pattern`, `volatility_analysis`, `trend_analysis`, `deviation_percentage`, `deviation_interpretation`, `volatility_level`, `volatility_cv_interpretation`, `trend_strength`, `trend_consistency`, `short_term_outlook`, `pattern_sustainability`, `external_factors_note`, `created_at`, `updated_at`) VALUES
(1, 1653, 'VOLATIL', '2025-09-18', '2025-09-19', 'HIGH', 'BERGEJOLAK', 26.83, 'TURUN', 'SIGNIFIKAN', 'Harga Bawang Merah mengalami penurunan signifikan sebesar 20.00% dalam seminggu dan 37.50% dalam sebulan terakhir, menempatkannya 16.86% di bawah rata-rata 90 hari dengan volatilitas tinggi.', 'Harga saat ini (Rp 40.000) berada jauh di bawah rata-rata harga 90 hari (-16.86%) dan mendekati harga terendah dalam periode tersebut (Rp 30.000).', 'Teridentifikasi pola penurunan harga yang tajam dan konsisten dalam periode mingguan dan bulanan, mengindikasikan potensi kelebihan pasokan atau penurunan permintaan yang drastis.', 'Dengan Coefficient of Variation sebesar 26.83%, tingkat fluktuasi harga Bawang Merah tergolong tinggi, sejalan dengan karakteristik komoditas volatil.', 'Data menunjukkan tren penurunan harga yang kuat dan berkelanjutan, dengan perubahan signifikan secara mingguan dan bulanan.', -16.86, 'Harga saat ini secara signifikan berada 16.86% di bawah rata-rata harga 90 hari terakhir, menandakan pergeseran level harga yang substansial ke bawah.', 'TINGGI', 'Nilai Coefficient of Variation 26.83% mengindikasikan bahwa Bawang Merah memiliki tingkat fluktuasi harga yang tinggi relatif terhadap rata-ratanya, sesuai dengan sifat komoditas VOLATIL dan berada dalam kategori BERGEJOLAK.', 'KUAT', 'KONSISTEN', 'Berdasarkan tren penurunan yang kuat dan konsisten, harga Bawang Merah kemungkinan besar akan tetap stabil di level rendah saat ini atau berpotensi melanjutkan penurunan dalam 1-7 hari ke depan jika pasokan tetap tinggi dan tidak ada peningkatan signifikan pada permintaan.', 'Pola penurunan harga yang signifikan secara mingguan dan bulanan menunjukkan keberlanjutan tren ini dalam waktu dekat, kecuali terjadi intervensi pasar atau perubahan drastis pada faktor penawaran/permintaan.', 'Faktor eksternal seperti kebijakan pemerintah, perubahan mendadak dalam pola konsumsi akibat peristiwa khusus, bencana alam, atau gangguan rantai pasok yang tidak tercermin langsung dalam data statistik ini, tidak dianalisis dalam laporan ini.', '2025-09-18 09:58:25', '2025-09-19 05:02:58'),
(2, 1661, 'PENTING', '2025-09-18', '2025-09-19', 'HIGH', 'BERGEJOLAK', 4.00, 'TURUN', 'SIGNIFIKAN', 'Harga Telur Ayam Ras menunjukkan penurunan signifikan secara mingguan dan bulanan, dengan posisi saat ini di bawah rata-rata 90 hari dan mencapai harga terendah dalam periode tersebut.', 'Harga saat ini (Rp 29.000) berada 5.95% di bawah rata-rata harga 90 hari (Rp 30.833), mengindikasikan bahwa harga telur ayam ras saat ini relatif rendah dibandingkan dengan rata-rata tiga bulan terakhir.', 'Teridentifikasi pola penurunan harga yang konsisten dalam seminggu dan sebulan terakhir, menunjukkan tekanan jual atau peningkatan pasokan di pasar.', 'Coefficient of Variation (CV) sebesar 3.96% mengindikasikan tingkat volatilitas harga yang relatif rendah dalam 90 hari terakhir, meskipun ada penurunan tajam baru-baru ini. Ini menunjukkan bahwa meskipun ada pergerakan signifikan, fluktuasi harga secara umum masih terkendali.', 'Data menunjukkan tren penurunan harga yang jelas dan konsisten dari mingguan (-6.45%) hingga bulanan (-9.38%), yang mengarah pada kondisi harga yang lebih rendah di pasar.', -5.95, 'Harga saat ini 5.95% di bawah rata-rata harga 90 hari, menunjukkan periode harga yang lebih rendah dari biasanya dalam tiga bulan terakhir. Ini mendekati batas bawah kategori fluktuatif untuk komoditas pokok.', 'RENDAH', 'Nilai Coefficient of Variation (CV) sebesar 3.96% mengindikasikan bahwa fluktuasi harga Telur Ayam Ras dalam 90 hari terakhir berada pada tingkat yang sangat rendah, meskipun ada penurunan harga yang signifikan.', 'KUAT', 'KONSISTEN', 'Berdasarkan tren penurunan yang konsisten dan harga yang berada di level terendah 90 hari, harga Telur Ayam Ras kemungkinan akan cenderung stabil atau melanjutkan penurunan kecil dalam 1-7 hari ke depan, tergantung pada respon pasar dan dinamika pasokan.', 'Pola penurunan ini telah berlangsung selama lebih dari sebulan. Keberlanjutan pola akan sangat bergantung pada faktor-faktor fundamental pasokan dan permintaan serta kebijakan terkait komoditas ini.', 'Analisis ini semata-mata berdasarkan data harga yang tersedia dan tidak mempertimbangkan faktor eksternal seperti perubahan kebijakan pemerintah, iklim (di luar konteks musiman umum), atau gejolak ekonomi yang mungkin mempengaruhi harga, karena tidak tersedia dalam data input.', '2025-09-18 09:58:25', '2025-09-19 05:02:58'),
(3, 1644, 'POKOK', '2025-09-18', '2025-09-19', 'MEDIUM', 'FLUKTUATIF', 15.00, 'TURUN', 'NORMAL', 'Harga beras mengalami penurunan signifikan secara mingguan (-3.33%) setelah kenaikan bulanan, namun masih sedikit di atas rata-rata 90 hari dengan volatilitas rendah.', 'Harga saat ini (Rp 14.500) berada 2.55% di atas rata-rata harga 90 hari (Rp 14.139).', 'Teridentifikasi pola penurunan harga mingguan setelah periode kenaikan bulanan, menunjukkan adanya koreksi atau fluktuasi jangka pendek.', 'Dengan Coefficient of Variation sebesar 2.36%, komoditas ini menunjukkan tingkat volatilitas yang sangat rendah dalam 90 hari terakhir, mengindikasikan stabilitas harga yang kuat secara historis.', 'Tren jangka pendek (mingguan) menunjukkan penurunan yang perlu diperhatikan, meskipun tren jangka menengah (bulanan) masih dalam arah positif dan harga saat ini relatif stabil dibandingkan rata-rata historis.', 2.55, 'Harga saat ini 2.55% lebih tinggi dari rata-rata harga 90 hari, menunjukkan bahwa harga masih berada dalam rentang wajar di atas rata-rata jangka menengah.', 'RENDAH', 'Coefficient of Variation sebesar 2.36% menunjukkan bahwa Beras Cap Burung Hong (Medium) memiliki tingkat fluktuasi harga yang sangat rendah dalam 90 hari terakhir, mengindikasikan stabilitas harga yang tinggi.', 'LEMAH', 'TIDAK_KONSISTEN', 'Berdasarkan penurunan mingguan, terdapat indikasi bahwa harga dapat cenderung stabil atau melanjutkan penurunan ringan dalam 1-7 hari ke depan, mendekati rata-rata 90 hari.', 'Pola fluktuasi harga (turun mingguan setelah naik bulanan) menunjukkan ketidakpastian tren yang berkelanjutan, sehingga sulit memprediksi keberlanjutan pola secara jangka panjang berdasarkan data ini saja.', 'Faktor eksternal seperti kebijakan pemerintah, kondisi cuaca ekstrem di daerah produsen, perubahan preferensi konsumen, atau dinamika pasar global tidak dianalisis karena tidak termasuk dalam data input.', '2025-09-18 09:58:25', '2025-09-19 05:02:58'),
(4, 1645, 'POKOK', '2025-09-18', '2025-09-19', 'HIGH', 'FLUKTUATIF', 5.00, 'TURUN', 'NORMAL', 'Harga beras mengalami penurunan mingguan sebesar -3.33% setelah sebelumnya menunjukkan kenaikan bulanan, mengindikasikan fluktuasi jangka pendek meskipun volatilitas keseluruhan tetap rendah.', 'Harga saat ini Rp 14.500, yang berada 2.55% di atas rata-rata harga 90 hari terakhir, namun masih dalam rentang pergerakan yang wajar.', 'Teridentifikasi pola penurunan harga mingguan setelah periode kenaikan bulanan. Harga bergerak dalam rentang yang relatif stabil jika dilihat dari historis 90 hari.', 'Tingkat volatilitas (Coefficient of Variation) sebesar 2.36% menunjukkan stabilitas harga yang sangat tinggi untuk komoditas pokok ini.', 'Secara mingguan, harga menunjukkan tren penurunan sebesar -3.33%. Namun, secara bulanan, harga masih menunjukkan tren kenaikan sebesar 3.57%, mengindikasikan adanya pergerakan yang tidak konsisten antara periode jangka pendek dan menengah.', 2.55, 'Harga saat ini sedikit lebih tinggi dari rata-rata harga 90 hari, namun deviasi ini masih berada dalam batas toleransi untuk komoditas pokok.', 'RENDAH', 'Nilai Coefficient of Variation (CV) sebesar 2.36% sangat rendah, menunjukkan bahwa harga beras Cap Anggrek (Medium) memiliki stabilitas yang tinggi dan tidak terlalu berfluktuasi dalam 90 hari terakhir.', 'LEMAH', 'TIDAK_KONSISTEN', 'Berdasarkan penurunan mingguan, ada indikasi potensi stabilisasi atau sedikit penurunan lebih lanjut dalam 1-7 hari ke depan, namun volatilitas rendah mungkin membatasi pergerakan signifikan.', 'Pola fluktuasi yang tidak konsisten antara tren mingguan (turun) dan bulanan (naik) mengindikasikan bahwa pola ini mungkin tidak berkelanjutan tanpa pemicu eksternal yang jelas.', 'Analisis ini tidak mempertimbangkan faktor eksternal seperti kebijakan pemerintah, bencana alam, perubahan iklim, atau dinamika pasar global yang mungkin berdampak pada harga komoditas.', '2025-09-18 09:58:25', '2025-09-19 05:02:58'),
(5, 1654, 'POKOK', '2025-09-18', '2025-09-19', 'HIGH', 'STABIL', 8.00, 'SIDEWAYS', 'NORMAL', 'Harga Gula Pasir Curah menunjukkan stabilitas penuh tanpa perubahan harga harian, mingguan, maupun bulanan, dan berada sedikit di bawah rata-rata historis 90 hari.', 'Harga saat ini (Rp 17.000) berada 1.80% di bawah rata-rata harga 90 hari terakhir (Rp 17.311), mengindikasikan posisi yang sedikit lebih rendah dari rata-rata historis namun masih dalam rentang stabil.', 'Pola harga Gula Pasir Curah menunjukkan stabilitas ekstrim dalam jangka pendek (harian, mingguan, bulanan) dengan tidak adanya pergerakan harga yang terdeteksi. Ini mengindikasikan pasar yang sangat tenang.', 'Tingkat volatilitas harga sangat rendah, sebagaimana ditunjukkan oleh Coefficient of Variation (CV) sebesar 2.67%. Ini jauh di bawah ambang batas stabilitas untuk komoditas pokok, menunjukkan harga yang sangat konsisten.', 'Data menunjukkan tidak ada tren pergerakan harga yang jelas dalam periode harian, mingguan, maupun bulanan. Harga cenderung bergerak sideways dan stagnan pada level saat ini.', -1.80, 'Harga saat ini berada 1.80% di bawah rata-rata harga 90 hari, menunjukkan posisi yang sedikit lebih rendah dari nilai tengah historis.', 'RENDAH', 'Nilai Coefficient of Variation (2.67%) sangat rendah, mengindikasikan bahwa harga Gula Pasir Curah sangat stabil dan memiliki fluktuasi minimal selama periode 90 hari terakhir.', 'LEMAH', 'KONSISTEN', 'Berdasarkan data harga saat ini yang stagnan, indikasi jangka pendek (1-7 hari) adalah kelanjutan stabilitas harga tanpa pergerakan signifikan.', 'Pola stagnasi harga yang terlihat dalam sebulan terakhir mengindikasikan kemungkinan keberlanjutan kondisi stabil ini dalam waktu dekat, meskipun anomali 0.00% harus tetap diwaspadai.', 'Analisis ini tidak mempertimbangkan faktor eksternal seperti kebijakan pemerintah, perubahan cuaca ekstrem, atau isu logistik yang mungkin mempengaruhi harga, karena data terkait tidak tersedia.', '2025-09-18 09:58:25', '2025-09-19 05:02:58'),
(6, 1651, 'VOLATIL', '2025-09-19', '2025-09-19', 'HIGH', 'EKSTREM', 75.00, 'NAIK', 'SIGNIFIKAN', 'Harga Cabai Merah Besar mengalami kenaikan sangat drastis dan signifikan dalam seminggu terakhir, mencapai level ekstrem yang jauh di atas rata-rata historis.', 'Harga saat ini (Rp 70.000) berada 39.69% di atas rata-rata harga 90 hari (Rp 50.111), menunjukkan posisi harga yang sangat tinggi relatif terhadap historis.', 'Terjadi lonjakan harga yang sangat tajam dan signifikan dalam periode mingguan (55.56%), yang juga tercermin pada perubahan bulanan. Pola ini mengindikasikan tekanan kenaikan harga yang sangat kuat dan tiba-tiba.', 'Meskipun Coefficient of Variation (17.09%) secara historis menempatkan komoditas ini dalam kategori fluktuatif hingga bergejolak, perubahan harga mingguan sebesar 55.56% menunjukkan volatilitas aktual saat ini berada pada tingkat yang sangat tinggi, jauh melampaui rata-rata.', 'Tren kenaikan harga sangat kuat dan konsisten dalam periode mingguan dan bulanan, mengindikasikan momentum kenaikan yang substansial. Tidak ada perubahan harian pada data terakhir yang mungkin menunjukkan harga stabil sementara di titik puncak atau tidak ada transaksi yang dilaporkan.', 39.69, 'Harga saat ini Rp 70.000, berada 39.69% di atas rata-rata harga 90 hari (Rp 50.111), menunjukkan posisi harga yang sangat tinggi dan tidak normal relatif terhadap historis.', 'SANGAT_TINGGI', 'Coefficient of Variation sebesar 17.09% menunjukkan bahwa harga Cabai Merah Besar secara inheren memiliki tingkat fluktuasi yang tinggi. Namun, perubahan mingguan 55.56% mengindikasikan lonjakan volatilitas yang ekstrem dan di luar karakteristik CV historis.', 'KUAT', 'KONSISTEN', 'Berdasarkan pola kenaikan ekstrem yang signifikan, harga Cabai Merah Besar diperkirakan akan tetap tinggi atau berpotensi melanjutkan kenaikan dalam 1-7 hari ke depan jika tidak ada intervensi atau perubahan mendasar pada pasokan.', 'Pola kenaikan harga sebesar 55.56% dalam seminggu tidak berkelanjutan dalam jangka panjang dan mengindikasikan kondisi pasar yang sangat abnormal yang memerlukan tindakan cepat.', 'Analisis ini secara ketat didasarkan pada data statistik yang tersedia dan tidak mempertimbangkan secara langsung faktor eksternal seperti kebijakan pemerintah, bencana alam, gangguan rantai pasok, atau perubahan preferensi konsumen yang dapat memengaruhi harga. Ini adalah murni dukungan informasi berbasis data.', '2025-09-19 07:20:28', '2025-09-19 07:20:28'),
(7, 1652, 'VOLATIL', '2025-09-19', '2025-09-19', 'HIGH', 'BERGEJOLAK', 54.00, 'NAIK', 'SIGNIFIKAN', 'Harga Cabai Rawit Merah menunjukkan kenaikan tajam sebesar 25.00% dalam seminggu terakhir, mendorong kondisinya menjadi bergejolak meskipun secara keseluruhan masih di bawah rata-rata 90 hari.', 'Harga saat ini Rp 50.000, yang berada sedikit di bawah (-2.49%) rata-rata harga 90 hari (Rp 51.278), mengindikasikan potensi ruang untuk kenaikan lebih lanjut atau pemulihan harga dari periode sebelumnya.', 'Data menunjukkan pola kenaikan harga yang sangat signifikan secara mingguan (+25.00%) setelah periode harga yang mungkin lebih rendah, meskipun harga saat ini masih lebih rendah dari puncak historis (Rp 75.000).', 'Coefficient of Variation (CV) sebesar 18.82% menunjukkan tingkat volatilitas harga yang cukup tinggi dan berada dalam rentang fluktuatif untuk komoditas jenis ini, konsisten dengan karakteristik Cabai Rawit Merah sebagai komoditas volatil.', 'Terdapat tren kenaikan harga yang kuat dalam jangka pendek (mingguan +25.00%) dan tren kenaikan moderat dalam jangka menengah (bulanan +11.11%), menunjukkan momentum harga ke atas yang signifikan.', -2.49, 'Harga saat ini berada sedikit di bawah rata-rata harga dalam 90 hari terakhir, mengindikasikan bahwa meskipun terjadi kenaikan mingguan yang tajam, harga belum melampaui level rata-rata historis jangka pendek.', 'SEDANG', 'Nilai CV 18.82% mengindikasikan fluktuasi harga yang substansial, menempatkan komoditas ini dalam kategori fluktuatif hingga bergejolak berdasarkan kerangka analisis.', 'KUAT', 'KONSISTEN', 'Berdasarkan kenaikan harga mingguan sebesar 25.00%, terdapat indikasi kuat bahwa harga Cabai Rawit Merah berpotensi melanjutkan tren kenaikannya dalam 1-7 hari ke depan jika faktor pendorong tetap ada.', 'Kenaikan harga yang sangat tajam seperti ini mungkin sulit untuk dipertahankan secara berkelanjutan tanpa adanya fundamental yang kuat. Namun, momentum harga saat ini mengindikasikan potensi berlanjutnya tren naik dalam jangka pendek.', 'Analisis ini tidak mencakup faktor eksternal seperti kebijakan pemerintah, bencana alam yang tidak terkait langsung dengan produksi, atau perubahan perilaku konsumen yang tidak tercermin dalam data harga yang disediakan.', '2025-09-19 07:20:28', '2025-09-19 07:20:28'),
(8, 1650, 'VOLATIL', '2025-09-19', '2025-09-19', 'HIGH', 'BERGEJOLAK', 24.05, 'NAIK', 'SIGNIFIKAN', 'Harga Cabai Merah Keriting menunjukkan kenaikan signifikan secara mingguan dan bulanan, mengindikasikan kondisi harga yang bergejolak dan memerlukan pemantauan intensif.', 'Harga saat ini (Rp 55.000) berada 11.24% lebih tinggi dari rata-rata harga 90 hari terakhir (Rp 49.444).', 'Data menunjukkan pola kenaikan harga yang konsisten dalam satu minggu dan satu bulan terakhir, meskipun harga tidak berubah pada hari terakhir. Pola ini konsisten dengan karakteristik komoditas yang volatil.', 'Coefficient of Variation sebesar 24.05% mengindikasikan tingkat volatilitas yang tinggi, berada di ambang batas atas untuk kondisi fluktuatif dan mendekati level bergejolak, menandakan pergerakan harga yang cepat.', 'Tren harga secara mingguan dan bulanan menunjukkan kenaikan yang kuat dan konsisten (22.22%). Meskipun harga harian saat ini stabil (0.00%), kenaikan signifikan sebelumnya masih mendominasi tren keseluruhan.', 11.24, 'Harga saat ini lebih tinggi 11.24% dibandingkan rata-rata harga dalam 90 hari terakhir, mengindikasikan adanya tekanan kenaikan harga yang berkelanjutan.', 'TINGGI', 'Coefficient of Variation (24.05%) berada pada level tinggi, menunjukkan fluktuasi harga yang signifikan dan konsisten dengan kategori komoditas volatil. Angka ini berada dalam rentang fluktuatif namun mendekati bergejolak.', 'KUAT', 'KONSISTEN', 'Meskipun harga harian stabil pada hari terakhir, tren kenaikan mingguan dan bulanan yang signifikan mengindikasikan potensi tekanan kenaikan harga lebih lanjut dalam 1-7 hari ke depan, kecuali ada intervensi pasar atau perubahan mendasar pada pasokan/permintaan.', 'Pola kenaikan yang kuat dan tingkat volatilitas yang tinggi menunjukkan bahwa harga komoditas ini rentan terhadap fluktuasi, dan tren kenaikan saat ini memiliki kemungkinan untuk berkelanjutan dalam jangka pendek tanpa perubahan fundamental yang signifikan.', 'Analisis ini didasarkan murni pada data statistik yang disediakan dan tidak mempertimbangkan faktor eksternal seperti kebijakan pemerintah, bencana alam, gangguan rantai pasok global, atau perubahan daya beli masyarakat, yang dapat memengaruhi harga komoditas secara signifikan.', '2025-09-19 07:20:28', '2025-09-19 07:20:28'),
(9, 1653, 'VOLATIL', '2025-09-19', '2025-09-19', 'HIGH', 'BERGEJOLAK', 27.00, 'TURUN', 'SIGNIFIKAN', 'Harga Bawang Merah mengalami penurunan signifikan sebesar 20.00% secara mingguan dan 37.50% secara bulanan, menempatkannya 16.86% di bawah rata-rata 90 hari, dengan volatilitas sangat tinggi (CV 26.83%). Kondisi ini diklasifikasikan sebagai BERGEJOLAK.', 'Harga Bawang Merah saat ini Rp 40.000, berada 16.86% di bawah rata-rata harga 90 hari terakhir (Rp 48.111).', 'Teridentifikasi pola penurunan harga yang kuat dan konsisten dalam periode mingguan dan bulanan. Penurunan mingguan (-20.00%) dan bulanan (-37.50%) menunjukkan pergerakan harga yang signifikan jauh di luar fluktuasi normal untuk komoditas volatil.', 'Dengan Coefficient of Variation (CV) sebesar 26.83%, tingkat volatilitas Bawang Merah sangat tinggi. Ini mengindikasikan bahwa harga komoditas ini rentan terhadap pergerakan yang cepat dan besar, sesuai dengan karakteristik komoditas volatil dalam kondisi bergejolak.', 'Tren pergerakan harga jelas menunjukkan penurunan yang kuat. Penurunan mingguan -20.00% dan bulanan -37.50% secara konsisten mendorong harga ke bawah, jauh dari rata-rata historisnya.', -16.86, 'Harga saat ini berada 16.86% di bawah rata-rata harga 90 hari terakhir, yang mengindikasikan bahwa harga telah menyimpang secara signifikan dari pola historisnya.', 'SANGAT_TINGGI', 'Coefficient of Variation (CV) sebesar 26.83% menempatkan volatilitas Bawang Merah pada level sangat tinggi, mengindikasikan fluktuasi harga yang substansial dan cepat relatif terhadap rata-rata harganya.', 'KUAT', 'KONSISTEN', 'Berdasarkan pola penurunan harga yang kuat dan konsisten, harga Bawang Merah diindikasikan akan tetap berada pada level rendah atau berpotensi melanjutkan penurunan dalam 1-7 hari ke depan, kecuali ada faktor pemicu yang mengubah dinamika pasar secara signifikan.', 'Tren penurunan yang terjadi selama satu bulan terakhir dengan tingkat volatilitas yang tinggi menunjukkan bahwa pola ini memiliki momentum yang kuat dan kemungkinan akan berlanjut dalam jangka pendek hingga menengah jika tidak ada intervensi atau perubahan fundamental pada sisi pasokan/permintaan.', 'Analisis ini tidak secara eksplisit mempertimbangkan dampak faktor eksternal seperti perubahan kebijakan pemerintah, bencana alam, atau perubahan perilaku konsumen yang tidak tercermin dalam data harga yang tersedia.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(10, 1677, 'PENTING', '2025-09-19', '2025-09-19', 'HIGH', 'BERGEJOLAK', 9.09, 'NAIK', 'SIGNIFIKAN', 'Harga Udang Basah mengalami kenaikan signifikan sebesar 20.00% dalam seminggu dan sebulan terakhir, mencapai level tertinggi dalam 90 hari, meskipun volatilitas relatif historis 90 hari tergolong rendah.', 'Harga saat ini Rp 60.000, merupakan harga tertinggi dalam 90 hari terakhir dan 9.09% di atas rata-rata harga periode tersebut.', 'Teridentifikasi pola kenaikan harga yang tajam dan konsisten dalam periode mingguan dan bulanan, menempatkan komoditas ini dalam kondisi harga Bergejolak.', 'Coefficient of Variation (CV) sebesar 9.09% mengindikasikan tingkat volatilitas relatif yang rendah selama 90 hari terakhir, namun lonjakan harga 20% baru-baru ini menunjukkan peningkatan volatilitas jangka pendek yang signifikan.', 'Data menunjukkan tren kenaikan harga yang kuat dan stabil selama seminggu dan sebulan terakhir, meskipun tidak ada perubahan harga pada hari analisis.', 9.09, 'Harga saat ini 9.09% lebih tinggi dari rata-rata harga 90 hari, mengindikasikan tekanan kenaikan harga yang signifikan dari kondisi normal.', 'RENDAH', 'Nilai Coefficient of Variation 9.09% menunjukkan bahwa secara historis dalam 90 hari terakhir, harga Udang Basah memiliki volatilitas relatif yang rendah, namun kenaikan 20% mingguan/bulanan adalah anomali.', 'KUAT', 'KONSISTEN', 'Berdasarkan kenaikan harga yang signifikan dan posisi harga saat ini di level tertinggi, ada indikasi potensi tekanan kenaikan harga yang masih akan berlanjut atau setidaknya harga akan stabil di level tinggi dalam 1-7 hari ke depan.', 'Kenaikan harga yang tajam dan tidak didukung oleh volatilitas historis yang tinggi menunjukkan bahwa pola ini mungkin tidak berkelanjutan tanpa pendorong fundamental yang kuat (misalnya, kelangkaan pasokan).', 'Analisis ini hanya berdasarkan data harga internal pasar dan tidak memperhitungkan faktor eksternal seperti perubahan kondisi cuaca di laut, harga pakan (jika budidaya), kebijakan pemerintah, atau event khusus yang dapat mempengaruhi pasokan/permintaan.', '2025-09-19 07:20:29', '2025-09-19 07:20:29'),
(24, 1651, 'VOLATIL', '2025-09-21', '2025-09-19', 'MEDIUM', 'EKSTREM', 68.13, 'NAIK', 'SIGNIFIKAN', 'Harga Cabai Merah Besar,1 kg saat ini Rp 70.000, mengalami kenaikan ekstrem sebesar 55.56% dalam seminggu terakhir. Komoditas ini tidak memiliki Harga Eceran Tertinggi (HET) atau Harga Acuan Penjualan (HAP), sehingga pergerakan harga sepenuhnya diserahkan pada mekanisme pasar. Kenaikan ini menempatkan harga jauh di atas rata-rata 90 hari terakhir.', 'Harga saat ini (Rp 70.000) berada 39.69% di atas rata-rata harga 90 hari (Rp 50.111), mendekati harga tertinggi dalam periode tersebut (Rp 80.000) dan jauh di atas harga terendah (Rp 40.000).', 'Setelah stabil di angka Rp 45.000 selama beberapa hari (11-15 September), harga Cabai Merah Besar mengalami lonjakan tajam sebesar 77.78% pada 16 September (dari Rp 45.000 ke Rp 80.000). Kemudian, harga sedikit terkoreksi ke Rp 70.000 pada 17 September dan bertahan stabil pada level tersebut hingga data terakhir (19 September).', 'Indeks volatilitas mencapai 68.13, yang tergolong TINGGI. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation sebesar 17.09%) telah mencapai lebih dari dua pertiga (sekitar 68%) dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (25.08%). Lonjakan harga yang mendadak dalam seminggu terakhir secara jelas mengindikasikan tingkat volatilitas yang signifikan.', 'Dalam jangka pendek (mingguan), harga menunjukkan tren kenaikan yang sangat tajam dan mendadak. Meskipun ada koreksi kecil setelah lonjakan, harga bertahan pada level yang tinggi dan jauh di atas rata-rata 90 hari, menunjukkan tekanan inflasi yang kuat.', 39.69, 'Harga saat ini Rp 70.000, berada 39.69% di atas rata-rata harga 90 hari terakhir (Rp 50.111), mengindikasikan bahwa harga saat ini jauh lebih tinggi dari kondisi normal dalam tiga bulan terakhir.', 'TINGGI', 'Dengan Coefficient of Variation (CV) 17.09%, komoditas ini menunjukkan tingkat fluktuasi harga yang tinggi, menempatkannya dalam kategori \'Bergejolak\' (15-25% untuk komoditas volatil) dan jauh di atas kondisi stabil.', 'KUAT', 'TIDAK_KONSISTEN', 'Mengingat harga bertahan stabil di level tinggi (Rp 70.000) selama tiga hari terakhir setelah lonjakan ekstrem, tekanan harga kemungkinan akan berlanjut dalam 1-7 hari ke depan jika tidak ada intervensi yang kuat atau peningkatan pasokan yang signifikan. Curah hujan yang masih tinggi juga dapat memperburuk situasi.', 'Pola lonjakan harga yang tajam dan bertahan pada level tinggi menunjukkan bahwa faktor penyebabnya (kemungkinan gangguan pasokan akibat cuaca) masih persisten. Kondisi ini dapat mempertahankan harga tinggi dalam beberapa minggu ke depan, terutama jika kondisi cuaca pancaroba terus mengganggu produksi dan distribusi.', 'Analisis ini tidak secara spesifik mempertimbangkan faktor eksternal non-cuaca seperti perubahan kebijakan perdagangan, isu logistik nasional yang lebih luas, atau sentimen pasar global yang juga dapat memengaruhi harga komoditas.', '2025-09-21 06:59:12', '2025-09-21 15:57:08'),
(25, 1652, 'VOLATIL', '2025-09-21', '2025-09-19', 'HIGH', 'BERGEJOLAK', 53.90, 'NAIK', 'SIGNIFIKAN', 'Harga Cabai Rawit Merah saat ini Rp 50.000 per kg, menunjukkan kenaikan signifikan sebesar 25.00% dalam seminggu terakhir. Harga ini masih berada di dalam rentang Harga Acuan Penjualan (HAP) Perbadan No. 12/2024 yaitu Rp 40.000 - Rp 57.000. Meskipun demikian, laju kenaikannya mendekati batas kategori ekstrem untuk komoditas volatil.', 'Harga saat ini Rp 50.000, berada 2.49% di bawah harga rata-rata 90 hari terakhir (Rp 51.278), menunjukkan bahwa kenaikan harga yang terjadi sangat baru dan belum sepenuhnya menggeser posisi rata-rata historis jangka pendek ke atas.', 'Terjadi lonjakan harga yang cepat dalam 7 hari terakhir, dari Rp 40.000 pada tanggal 15/9/2025 menjadi Rp 50.000 pada tanggal 17/9/2025, dan bertahan stabil di level tersebut hingga data terakhir. Pola ini menunjukkan adanya *shock* harga yang mendadak setelah periode stabil.', 'Indeks volatilitas saat ini mencapai 53.90, yang tergolong SEDANG hingga CUKUP TINGGI. Ini karena tingkat fluktuasi harga saat ini (CV 18.82%) telah mencapai lebih dari separuh dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (34.91%). Meskipun belum mencapai level ekstrem, CV yang mendekati 20% untuk komoditas volatil tetap memerlukan kewaspadaan.', 'Tren harga menunjukkan kenaikan yang kuat dan cepat dalam seminggu terakhir (25.00%) dan berlanjut dalam sebulan terakhir (11.11%). Kenaikan ini terjadi setelah beberapa hari harga stagnan di level rendah, menunjukkan pembalikan tren yang agresif.', -2.49, 'Harga saat ini sedikit lebih rendah dari rata-rata harga 90 hari, mengindikasikan bahwa lonjakan harga baru-baru ini belum sepenuhnya terekam dalam rata-rata jangka panjang atau masih ada periode harga rendah sebelumnya yang dominan.', 'SEDANG', 'Coefficient of Variation (CV) sebesar 18.82% menunjukkan bahwa tingkat dispersi harga relatif terhadap rata-rata cukup signifikan untuk komoditas volatil, berada di batas atas kategori fluktuatif menuju bergejolak. Ini menandakan bahwa pergerakan harga tidak seragam dan memiliki variasi yang cukup besar.', 'KUAT', 'KONSISTEN', 'Mengingat kenaikan yang kuat dan stabilnya harga di level baru dalam beberapa hari terakhir, ada indikasi bahwa harga Cabai Rawit Merah akan bertahan di level saat ini atau berpotensi sedikit naik dalam 1-7 hari ke depan, terutama jika faktor penyebab (misalnya, cuaca) masih dominan.', 'Pola kenaikan harga yang dipicu oleh faktor musiman (cuaca) cenderung berkelanjutan selama kondisi tersebut belum membaik atau intervensi pasokan belum efektif. Tanpa tindakan, tren kenaikan ini memiliki potensi untuk berlanjut atau berulang di masa mendatang, terutama di periode pancaroba.', 'Faktor eksternal seperti perubahan kebijakan nasional, kondisi ekonomi makro, atau pergerakan harga komoditas lain yang tidak terkait langsung tidak dianalisis dalam laporan ini.', '2025-09-21 06:59:12', '2025-09-21 15:57:08'),
(26, 1650, 'VOLATIL', '2025-09-21', '2025-09-19', 'HIGH', 'BERGEJOLAK', 71.42, 'NAIK', 'SIGNIFIKAN', 'Harga Cabai Merah Keriting saat ini sebesar Rp 55.000, yang menunjukkan kenaikan signifikan sebesar 22.22% dalam seminggu terakhir. Harga ini berada tepat di batas atas rentang Harga Acuan Penjualan (HAP) sebesar Rp 37.000 - Rp 55.000 berdasarkan Perbadan No. 12/2024. Indeks volatilitas mencapai 71.42, menunjukkan tingkat fluktuasi harga yang tinggi.', 'Harga saat ini (Rp 55.000) berada tepat di batas atas Harga Acuan Penjualan (HAP) dan 11.24% di atas rata-rata harga 90 hari terakhir (Rp 49.444).', 'Setelah periode harga relatif stabil di sekitar Rp 45.000, terjadi lonjakan harga yang sangat tajam menjadi Rp 60.000, kemudian sedikit terkoreksi dan stabil di Rp 55.000. Ini menunjukkan pola kenaikan cepat yang signifikan diikuti oleh konsolidasi harga di level yang lebih tinggi.', 'Indeks volatilitas mencapai 71.42, yang tergolong TINGGI. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation 24.05%) telah mencapai lebih dari dua pertiga dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (33.67%).', 'Tren harga menunjukkan kenaikan yang tajam dan signifikan dalam seminggu terakhir, mendorong harga dari level stabil ke batas atas HAP. Meskipun ada sedikit koreksi, harga mempertahankan posisi tinggi setelah lonjakan.', 11.24, 'Harga saat ini 11.24% di atas rata-rata 90 hari, menunjukkan pergeseran ke level harga yang lebih tinggi dibandingkan periode sebelumnya.', 'TINGGI', 'Dengan Coefficient of Variation (CV) sebesar 24.05%, volatilitas harga Cabai Merah Keriting tergolong TINGGI, mengindikasikan pergerakan harga yang cukup sering dan besar.', 'KUAT', 'TIDAK_KONSISTEN', 'Dengan harga yang berada tepat di batas atas HAP dan kondisi cuaca pancaroba yang masih berlanjut (curah hujan tinggi), terdapat potensi harga tetap tinggi atau bahkan kembali bergerak naik dalam 1-7 hari ke depan jika pasokan tidak segera membaik atau ada gangguan distribusi lanjutan.', 'Pola lonjakan harga yang disebabkan oleh faktor cuaca cenderung bersifat sementara namun bisa berulang dan memiliki dampak jangka menengah jika kondisi cuaca ekstrem terus berlanjut atau tidak ada upaya mitigasi. Harga yang bertengger di batas atas HAP menunjukkan resistensi terhadap penurunan.', 'Analisis ini fokus pada faktor cuaca dan pasokan. Faktor eksternal non-cuaca seperti perubahan kebijakan impor/ekspor, kenaikan harga pupuk, atau serangan hama penyakit yang tidak terkait langsung dengan cuaca, tidak dianalisis secara spesifik dalam laporan ini.', '2025-09-21 06:59:12', '2025-09-21 15:57:08'),
(27, 1653, 'VOLATIL', '2025-09-21', '2025-09-19', 'HIGH', 'BERGEJOLAK', 92.13, 'TURUN', 'SIGNIFIKAN', 'Harga Bawang Merah saat ini berada di Rp 40.000/kg, menunjukkan penurunan tajam sebesar -20.00% dalam seminggu dan -37.50% dalam sebulan. Harga saat ini berada di dalam rentang Harga Acuan Penjualan (HAP) yaitu Rp 36.500 - Rp 41.500 berdasarkan Perbadan No. 12/2024, mengindikasikan harga telah terkoreksi ke level yang dianggap wajar.', 'Harga Bawang Merah saat ini Rp 40.000 berada 16.86% di bawah rata-rata harga 90 hari terakhir (Rp 48.111), menunjukkan koreksi signifikan setelah periode harga yang lebih tinggi. Harga saat ini lebih dekat ke harga terendah historis Rp 30.000 dibanding harga tertinggi Rp 70.000.', 'Teridentifikasi pola penurunan harga yang tajam dan konsisten selama seminggu terakhir, dari Rp 50.000 menjadi Rp 40.000. Pola ini juga tercermin dalam penurunan bulanan yang lebih besar, mengindikasikan koreksi pasar.', 'Indeks volatilitas mencapai 92.13, yang tergolong SANGAT TINGGI. Ini karena tingkat fluktuasi harga saat ini (CV 26.83%) telah mencapai lebih dari 90% dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (29.12%). Hal ini menunjukkan pasar Bawang Merah saat ini sangat dinamis dan berpotensi mengalami perubahan harga yang cepat.', 'Tren harga menunjukkan penurunan yang kuat dan konsisten dalam seminggu dan sebulan terakhir. Meskipun harga harian saat ini stabil, penurunan mingguan -20.00% dan bulanan -37.50% menunjukkan momentum penurunan yang signifikan.', -16.86, 'Harga saat ini Rp 40.000 berada 16.86% di bawah rata-rata harga 90 hari terakhir (Rp 48.111), menandakan penurunan yang cukup tajam dan menjauh dari level harga rata-rata historis jangka pendek.', 'SANGAT_TINGGI', 'Dengan Coefficient of Variation (CV) sebesar 26.83%, harga Bawang Merah menunjukkan tingkat fluktuasi yang SANGAT TINGGI, berada sangat dekat dengan ambang batas volatilitas ekstrem historisnya. Ini mengindikasikan ketidakpastian harga yang tinggi di pasar.', 'KUAT', 'KONSISTEN', 'Mengingat momentum penurunan harga yang kuat dan posisi harga yang kembali ke rentang HAP, Bawang Merah cenderung akan stabil atau melanjutkan penurunannya dalam 1-7 hari ke depan, asalkan pasokan tetap memadai dan tidak ada guncangan permintaan mendadak.', 'Pola penurunan harga ini bisa berkelanjutan jika produksi Bawang Merah di sentra-sentra utama tetap tinggi dan cuaca pancaroba tidak menyebabkan gangguan signifikan pada distribusi atau kerusakan hasil panen. Namun, volatilitas yang tinggi menyiratkan perubahan arah yang cepat mungkin terjadi.', 'Faktor eksternal seperti perubahan kebijakan pemerintah pusat (misal: kebijakan impor/ekspor), gejolak harga komoditas global, atau perubahan drastis dalam pola konsumsi masyarakat tidak dianalisis secara spesifik dalam laporan ini.', '2025-09-21 06:59:12', '2025-09-21 15:57:08'),
(28, 1677, 'PENTING', '2025-09-21', '2025-09-19', 'MEDIUM', 'BERGEJOLAK', 90.91, 'NAIK', 'SIGNIFIKAN', 'Harga Udang Basah,1 kg di Kabupaten Mempawah saat ini berada di Rp 60.000, menunjukkan kenaikan signifikan sebesar 20.00% dalam satu minggu terakhir dan mencapai harga tertinggi dalam 90 hari. Tidak ada Harga Eceran Tertinggi (HET) atau Harga Acuan Penjualan (HAP) yang ditetapkan untuk komoditas ini, sehingga status harga diatur oleh mekanisme pasar.', 'Harga Udang Basah,1 kg saat ini (Rp 60.000) adalah 9.09% di atas rata-rata harga 90 hari terakhir dan merupakan harga tertinggi yang tercatat dalam periode tersebut.', 'Teridentifikasi pola kenaikan harga yang tajam dan cepat dalam beberapa hari terakhir, setelah periode stabilitas harga di Rp 50.000. Pola ini mengindikasikan adanya pergeseran mendadak dalam dinamika pasar.', 'Indeks volatilitas mencapai 90.91, yang tergolong TINGGI. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation sebesar 9.09%) telah mendekati ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (persentil ke-95 sebesar 10.00%). Situasi ini menunjukkan pasar sedang mengalami ketidakpastian harga yang tinggi.', 'Harga menunjukkan tren kenaikan yang kuat dan konsisten dalam seminggu terakhir, terutama terlihat sejak tanggal 16/9/2025. Perubahan mingguan sebesar 20% menegaskan kekuatan tren ini dalam jangka pendek.', 9.09, 'Harga Udang Basah,1 kg saat ini 9.09% lebih tinggi dari rata-rata harga 90 hari terakhir, menempatkannya di atas level harga normal jangka menengah.', 'SANGAT_TINGGI', 'Tingkat fluktuasi harga saat ini (CV 9.09%) sangat mendekati ambang batas volatilitas historis (P95: 10.00%), mengindikasikan bahwa harga Udang Basah,1 kg sedang mengalami tingkat volatilitas yang luar biasa dan mendekati rekor historisnya.', 'KUAT', 'KONSISTEN', 'Dengan kenaikan tajam dan volatilitas yang tinggi, harga Udang Basah,1 kg kemungkinan akan tetap tinggi dalam 1-7 hari ke depan, kecuali ada intervensi signifikan atau pemulihan pasokan yang cepat.', 'Pola kenaikan harga tajam ini baru terjadi dalam seminggu terakhir, sehingga keberlanjutannya akan sangat bergantung pada faktor cuaca dan respons pasokan. Jika gangguan berlanjut, tren kenaikan bisa dipertahankan.', 'Analisis ini tidak mencakup faktor-faktor eksternal yang lebih luas seperti perubahan kebijakan impor/ekspor, tren pasar global, atau pergeseran preferensi konsumen yang dapat mempengaruhi harga Udang Basah,1 kg.', '2025-09-21 06:59:12', '2025-09-21 15:57:08'),
(29, 1651, 'VOLATIL', '2025-09-22', '2025-09-22', 'HIGH', 'EKSTREM', 68.13, 'NAIK', 'SIGNIFIKAN', 'Harga Cabai Merah Besar mengalami kenaikan mingguan yang ekstrem sebesar 55.56%, menempatkannya 39.69% di atas harga rata-rata 90 hari. Indeks volatilitas mencapai 68.13, yang tergolong TINGGI, menandakan bahwa tingkat fluktuasi harga saat ini (CV 17.09%) sudah mendekati ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (P95: 25.08%). Tidak ada data Harga Eceran Tertinggi (HET) atau Harga Acuan Penjualan (HAP) yang tersedia untuk komoditas ini.', 'Harga saat ini sebesar Rp 70.000, berada 39.69% di atas harga rata-rata 90 hari (Rp 50.111), menunjukkan posisi harga yang jauh lebih tinggi dari kondisi normal dalam tiga bulan terakhir.', 'Teridentifikasi pola kenaikan harga yang sangat tajam dan cepat dalam seminggu terakhir, dari Rp 45.000 menjadi Rp 80.000, kemudian sedikit terkoreksi dan stabil di Rp 70.000 selama beberapa hari terakhir. Pola ini menunjukkan adanya shock pasokan mendadak diikuti oleh stabilisasi sementara pada level harga yang lebih tinggi.', 'Indeks volatilitas mencapai 68.13, yang tergolong TINGGI. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation sebesar 17.09%) telah mencapai lebih dari dua pertiga dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (P95 sebesar 25.08%). Ini mengindikasikan bahwa pergerakan harga saat ini sangat tidak lazim.', 'Harga menunjukkan tren kenaikan yang sangat kuat dan signifikan dalam rentang mingguan (55.56%) dan bulanan (55.56%). Meskipun ada stabilisasi di hari-hari terakhir, tren ini mengindikasikan pergeseran ke level harga baru yang jauh lebih tinggi.', 39.69, 'Harga Cabai Merah Besar saat ini 39.69% lebih tinggi dari rata-rata harga dalam 90 hari terakhir, menunjukkan deviasi yang sangat signifikan dari pola historis.', 'SEDANG', 'Coefficient of Variation (CV) sebesar 17.09% menunjukkan tingkat fluktuasi harga berada pada level sedang. Namun, jika dibandingkan dengan ambang batas historis P95, ini mendekati zona volatilitas tinggi.', 'KUAT', 'KONSISTEN', 'Harga Cabai Merah Besar diperkirakan akan tetap berada pada level tinggi dalam 1-7 hari ke depan, mengingat stabilisasi harga di level yang lebih tinggi setelah lonjakan tajam. Potensi koreksi harga yang signifikan tanpa intervensi diperkirakan rendah.', 'Jika faktor penyebab kenaikan (diduga supply-side shock akibat cuaca) berlanjut atau tidak diatasi, pola harga tinggi ini kemungkinan akan berkelanjutan dalam beberapa minggu ke depan, membentuk baseline harga yang baru.', 'Analisis ini tidak mempertimbangkan faktor eksternal lain seperti kebijakan perdagangan nasional, perubahan tren konsumsi mendadak, atau peristiwa sosial-ekonomi yang lebih luas yang mungkin mempengaruhi harga.', '2025-09-22 05:02:47', '2025-09-22 06:55:10'),
(30, 1652, 'VOLATIL', '2025-09-22', '2025-09-22', 'HIGH', 'BERGEJOLAK', 52.32, 'NAIK', 'SIGNIFIKAN', 'Harga Cabai Rawit Merah,1 kg saat ini Rp 50.000, menunjukkan kenaikan 25.00% dalam seminggu. Harga ini berada di dalam rentang Harga Acuan Penjualan (HAP) yaitu Rp 40.000 - Rp 57.000 berdasarkan Perbadan No. 12/2024, namun lonjakan harga yang cepat menandakan pasar mulai bergejolak.', 'Harga saat ini sedikit di bawah rata-rata 90 hari (-1.96%), mengindikasikan bahwa level harga Rp 50.000 baru dicapai setelah periode fluktuasi, namun merupakan kenaikan signifikan dari posisi terendah baru-baru ini.', 'Teridentifikasi pola kenaikan harga yang bertahap dan signifikan dalam seminggu terakhir, dari Rp 40.000 menjadi Rp 50.000, diikuti oleh stabilisasi pada level harga yang lebih tinggi selama beberapa hari terakhir.', 'Indeks volatilitas mencapai 52.32, yang tergolong SEDANG menuju TINGGI. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation sebesar 18.27%) telah mencapai lebih dari setengah dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (P95 sebesar 34.91%), menandakan perlunya pemantauan ketat.', 'Harga menunjukkan tren kenaikan yang kuat secara mingguan (25.00%) dan moderat secara bulanan (11.11%). Meskipun perubahan harian saat ini stabil (0.00%), tren jangka pendek dan menengah jelas mengarah ke atas.', -1.96, 'Harga saat ini sedikit lebih rendah dari rata-rata harga 90 hari terakhir. Ini menunjukkan bahwa meskipun ada kenaikan signifikan baru-baru ini, harga secara keseluruhan masih dalam rentang fluktuasi historis periode tersebut.', 'SEDANG', 'Coefficient of Variation (CV) sebesar 18.27% menunjukkan bahwa harga Cabai Rawit Merah memiliki tingkat fluktuasi harga yang sedang. Angka ini menempatkan komoditas ini dalam kategori fluktuatif hingga bergejolak untuk komoditas volatil, mengindikasikan kebutuhan akan pemantauan berkelanjutan.', 'KUAT', 'KONSISTEN', 'Mengingat harga telah stabil di Rp 50.000 selama beberapa hari terakhir, diperkirakan harga akan cenderung stabil dalam 1-3 hari ke depan. Namun, tekanan kenaikan tetap ada jika isu pasokan tidak teratasi.', 'Pola kenaikan harga yang bergejolak saat ini tidak bersifat berkelanjutan dalam jangka panjang tanpa adanya stabilisasi pasokan. Keberlanjutan pola ini sangat bergantung pada perkembangan cuaca dan kondisi produksi.', 'Faktor eksternal seperti perubahan kebijakan impor/ekspor, subsidi pemerintah, atau dampak peristiwa global yang dapat memengaruhi harga komoditas pangan tidak dianalisis secara eksplisit dalam laporan ini.', '2025-09-22 05:02:47', '2025-09-22 06:55:10'),
(31, 1650, 'VOLATIL', '2025-09-22', '2025-09-22', 'MEDIUM', 'BERGEJOLAK', 70.54, 'NAIK', 'SIGNIFIKAN', 'Harga Cabai Merah Keriting,1 kg saat ini Rp 55.000, menunjukkan kenaikan mingguan signifikan sebesar 22.22%. Harga ini berada tepat pada batas atas rentang Harga Acuan Penjualan (HAP) yaitu Rp 37.000 - Rp 55.000 sesuai Perbadan No. 12/2024.', 'Harga saat ini Rp 55.000 berada 11.61% lebih tinggi dari rata-rata harga 90 hari (Rp 49.278) dan tepat pada batas atas Harga Acuan Penjualan (HAP).', 'Teridentifikasi pola kenaikan harga yang cepat dan signifikan dari Rp 45.000 ke Rp 60.000 pada pertengahan minggu lalu, kemudian stabil di Rp 55.000 selama beberapa hari terakhir, namun secara mingguan tetap menunjukkan peningkatan tajam.', 'Indeks volatilitas mencapai 70.54, yang tergolong TINGGI. Ini karena tingkat fluktuasi harga saat ini (CV 23.75%) telah mencapai lebih dari dua pertiga (sekitar 70%) dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (33.67%).', 'Terjadi tren kenaikan harga yang cukup kuat sebesar 22.22% dalam skala mingguan maupun bulanan, menunjukkan adanya tekanan inflasi yang persisten untuk komoditas ini dalam jangka pendek.', 11.61, 'Harga saat ini 11.61% lebih tinggi dari rata-rata harga 90 hari, mengindikasikan bahwa harga berada pada level yang relatif tinggi dibandingkan kondisi normal tiga bulan terakhir.', 'TINGGI', 'Nilai Coefficient of Variation (CV) sebesar 23.75% menunjukkan tingkat fluktuasi harga yang tinggi, mendekati batas atas kategori bergejolak untuk komoditas volatil.', 'KUAT', 'KONSISTEN', 'Meskipun harga stabil dalam beberapa hari terakhir di Rp 55.000, tren kenaikan mingguan dan bulanan yang kuat menunjukkan potensi harga tetap tinggi atau bahkan kembali naik dalam 1-7 hari ke depan, terutama jika pasokan tidak membaik atau faktor cuaca tetap mengganggu.', 'Pola kenaikan harga ini berpotensi berkelanjutan mengingat faktor musim pancaroba yang baru dimulai dan tingginya indeks volatilitas, yang menunjukkan pasar rentan terhadap guncangan pasokan dan perubahan harga yang signifikan.', 'Analisis ini tidak secara spesifik mempertimbangkan faktor eksternal makroekonomi (misalnya inflasi nasional, nilai tukar) atau kebijakan pemerintah di luar konteks harga acuan yang mungkin memengaruhi harga Cabai Merah Keriting.', '2025-09-22 05:02:47', '2025-09-22 06:55:10'),
(32, 1653, 'VOLATIL', '2025-09-22', '2025-09-22', 'HIGH', 'BERGEJOLAK', 91.36, 'TURUN', 'SIGNIFIKAN', 'Harga Bawang Merah saat ini Rp 40.000, berada di dalam rentang Harga Acuan Penjualan (HAP) Rp 36.500 - Rp 41.500 berdasarkan Perbadan No. 12/2024. Terjadi penurunan harga yang signifikan sebesar 20.00% dalam seminggu terakhir.', 'Harga saat ini berada 17.01% di bawah rata-rata harga 90 hari terakhir, menandakan pergeseran ke level harga yang lebih rendah.', 'Teridentifikasi pola penurunan harga yang tajam dalam dua minggu terakhir, diikuti oleh stabilisasi harga pada level yang lebih rendah (Rp 40.000) selama beberapa hari terakhir.', 'Indeks volatilitas mencapai 91.36, yang tergolong SANGAT TINGGI. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation 26.61%) telah mendekati ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (29.12%).', 'Harga Bawang Merah menunjukkan tren penurunan yang kuat dan konsisten dalam sebulan terakhir (-37.50%), dengan percepatan penurunan di minggu ini (-20.00%).', -17.01, 'Harga saat ini Rp 40.000 berada 17.01% di bawah rata-rata harga 90 hari (Rp 48.200), menunjukkan pergeseran signifikan ke tingkat harga yang lebih rendah dari historis jangka pendek.', 'SANGAT_TINGGI', 'Dengan Coefficient of Variation sebesar 26.61%, volatilitas harga Bawang Merah sangat tinggi, mendekati ambang batas ekstrem yang historis (P95 sebesar 29.12%), menandakan pasar yang sangat sensitif.', 'KUAT', 'KONSISTEN', 'Mengingat stabilisasi harga selama beberapa hari terakhir di Rp 40.000 dan posisi dalam rentang HAP, harga diperkirakan akan cenderung stabil dalam jangka pendek (1-7 hari), namun risiko perubahan harga yang cepat tetap tinggi mengingat volatilitasnya yang ekstrem.', 'Pola penurunan tajam kemungkinan akan melambat atau berbalik jika pasokan mulai berkurang atau jika ada intervensi untuk menstabilkan harga di tingkat petani, serta mempertimbangkan durasi musim panen.', 'Analisis ini tidak secara spesifik mempertimbangkan faktor eksternal makroekonomi (misalnya inflasi umum, nilai tukar mata uang) atau kebijakan perdagangan (misalnya impor/ekspor) yang mungkin mempengaruhi harga komoditas ini.', '2025-09-22 05:02:47', '2025-09-22 06:55:10'),
(33, 1677, 'PENTING', '2025-09-22', '2025-09-22', 'HIGH', 'BERGEJOLAK', 90.70, 'NAIK', 'SIGNIFIKAN', 'Harga Udang Basah saat ini Rp 60.000. Komoditas ini menunjukkan kenaikan signifikan sebesar 20.00% dalam seminggu. Indeks volatilitas berada pada 90.70, yang mengindikasikan bahwa tingkat fluktuasi harga saat ini mendekati ambang batas ekstrem historis untuk komoditas ini. Tidak ada data Harga Eceran Tertinggi (HET) atau Harga Acuan Penjualan (HAP) untuk Udang Basah.', 'Harga Udang Basah saat ini Rp 60.000, berada 8.87% di atas rata-rata harga 90 hari terakhir (Rp 55.111), menandakan posisi harga yang lebih tinggi dari normal jangka pendek.', 'Terjadi lonjakan harga signifikan dari Rp 50.000 menjadi Rp 60.000 di pertengahan minggu (antara 15/9/2025 dan 16/9/2025), setelah itu harga relatif stabil di level yang lebih tinggi hingga saat ini.', 'Indeks volatilitas mencapai 90.70, yang tergolong SANGAT TINGGI. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation sebesar 9.07%) telah mencapai lebih dari 90% dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (10.00%).', 'Harga menunjukkan tren kenaikan yang kuat dalam seminggu dan sebulan terakhir, dengan kenaikan masing-masing 20.00%. Perubahan harian menunjukkan stabilisasi di harga tertinggi dalam beberapa hari terakhir.', 8.87, 'Harga saat ini 8.87% di atas rata-rata 90 hari, menunjukkan tekanan kenaikan harga yang persisten dan berada di atas kondisi harga normal.', 'SANGAT_TINGGI', 'Nilai Coefficient of Variation (CV) sebesar 9.07% mendekati ambang batas volatilitas historis 10.00%, mengindikasikan pergerakan harga yang tidak biasa dan memerlukan pemantauan ketat.', 'KUAT', 'KONSISTEN', 'Harga Udang Basah diperkirakan akan tetap tinggi dalam jangka pendek mengingat kenaikan signifikan yang telah terjadi dan stabil di level tersebut, kecuali ada intervensi cepat atau perbaikan pasokan.', 'Kenaikan harga yang tajam dan volatilitas yang sangat tinggi menunjukkan pola yang mungkin tidak berkelanjutan jika tidak ada intervensi atau perbaikan kondisi pasokan yang mendasari.', 'Analisis ini tidak secara langsung memperhitungkan faktor eksternal lain seperti kebijakan impor/ekspor, subsidi energi, atau perubahan selera konsumen yang mungkin memengaruhi harga udang.', '2025-09-22 05:02:47', '2025-09-22 06:55:10');
INSERT INTO `analisis_harga` (`id`, `komoditas_id`, `commodity_category`, `analysis_date`, `data_freshness`, `analysis_confidence`, `condition_level`, `volatility_index`, `trend_direction`, `statistical_significance`, `key_observation`, `current_position`, `price_pattern`, `volatility_analysis`, `trend_analysis`, `deviation_percentage`, `deviation_interpretation`, `volatility_level`, `volatility_cv_interpretation`, `trend_strength`, `trend_consistency`, `short_term_outlook`, `pattern_sustainability`, `external_factors_note`, `created_at`, `updated_at`) VALUES
(34, 1651, 'VOLATIL', '2025-09-23', '2025-07-18', 'HIGH', 'BERGEJOLAK', 99.43, 'NAIK', 'SIGNIFIKAN', 'Harga Cabai Merah Besar menunjukkan kenaikan signifikan sebesar 25.00% dalam seminggu terakhir, mencapai Rp 50.000 per kg. Tingkat volatilitas harga saat ini (CV 24.94%) berada di ambang batas historis ekstrem, dengan indeks volatilitas mencapai 99.43. Meskipun harga saat ini masih 21.67% di bawah rata-rata 90 hari, kenaikan tajam ini menempatkan kondisi harga dalam kategori \'BERGEJOLAK\'.', 'Harga saat ini (Rp 50.000) berada di titik terendah kedua dalam 90 hari terakhir (terendah Rp 40.000) dan 21.67% lebih rendah dari rata-rata harga 90 hari. Namun, terjadi kenaikan tajam sebesar 25.00% dalam seminggu terakhir dari level terendah.', 'Teridentifikasi pola pembalikan harga dari titik terendah dalam 90 hari, ditandai dengan kenaikan harga yang cepat dan signifikan dalam seminggu terakhir. Harga stabil di level Rp 50.000 setelah lonjakan tersebut.', 'Indeks volatilitas mencapai 99.43, yang tergolong SANGAT TINGGI. Ini karena tingkat fluktuasi harga saat ini (CV 24.94%) telah mendekati ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (25.08%). Hal ini mengindikasikan pasar cabai merah besar sangat tidak stabil dan rentan terhadap pergerakan harga yang cepat.', 'Dalam seminggu terakhir, harga menunjukkan tren kenaikan yang kuat dan konsisten, membalikkan kemungkinan tren penurunan sebelumnya. Pergerakan dari Rp 40.000 ke Rp 50.000 merupakan sinyal pemulihan harga yang cepat dari level terendah.', -21.67, 'Harga saat ini 21.67% lebih rendah dari rata-rata harga 90 hari, menunjukkan masih berada di bawah level normal jangka menengah, meskipun terjadi kenaikan signifikan dalam seminggu terakhir.', 'SANGAT_TINGGI', 'Tingkat fluktuasi harga (CV 24.94%) hampir menyamai ambang batas volatilitas historis (P95 25.08%), mengindikasikan bahwa komoditas ini bergerak mendekati kondisi yang sangat tidak stabil.', 'KUAT', 'KONSISTEN', 'Mengingat kenaikan harga yang tajam dan volatilitas yang sangat tinggi, harga Cabai Merah Besar berpotensi melanjutkan kenaikannya atau setidaknya mempertahankan level tinggi dalam 1-7 hari ke depan, terutama jika gangguan pasokan akibat cuaca berlanjut atau permintaan tetap kuat.', 'Pola kenaikan harga yang cepat ini seringkali tidak berkelanjutan dalam jangka panjang tanpa dukungan faktor fundamental yang kuat. Namun, kondisi cuaca pancaroba saat ini dapat mempertahankan pola ini untuk sementara waktu.', 'Faktor-faktor eksternal yang lebih luas seperti perubahan kebijakan nasional, dinamika pasar regional yang tidak tercover dalam data cuaca, atau isu geopolitik tidak secara eksplisit dianalisis.', '2025-09-23 05:03:12', '2025-09-23 07:32:38'),
(35, 1652, 'VOLATIL', '2025-09-23', '2025-07-18', 'MEDIUM', 'BERGEJOLAK', 98.69, 'NAIK', 'SIGNIFIKAN', 'Harga Cabai Rawit Merah di Kabupaten Mempawah saat ini berada di Rp 60.000, yang berarti melebihi batas atas Harga Acuan Penjualan (HAP) Rp 57.000. Terjadi kenaikan harga signifikan sebesar 20.00% dalam seminggu terakhir dan 33.33% dalam sebulan terakhir. Tingkat volatilitas harga juga sangat tinggi, mendekati ambang batas ekstrem historis.', 'Harga saat ini (Rp 60.000) berada di atas batas atas HAP (Rp 57.000), namun perlu dicatat bahwa harga ini masih di bawah rata-rata harga 90 hari terakhir (Rp 77.389). Ini menunjukkan bahwa meskipun harga sedang mengalami kenaikan minggu ini, ada kemungkinan harga telah mengalami penurunan dari level yang lebih tinggi sebelumnya.', 'Teridentifikasi pola kenaikan harga yang cepat dan signifikan dalam rentang mingguan (+20.00%) dan bulanan (+33.33%) setelah kemungkinan adanya penurunan dari level harga yang lebih tinggi. Kenaikan ini terjadi di tengah kondisi volatilitas yang sangat tinggi.', 'Indeks volatilitas harga Cabai Rawit Merah mencapai 98.69, yang tergolong SANGAT TINGGI. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation sebesar 34.45%) telah mencapai hampir seluruh ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (34.91%). Ini menunjukkan pergerakan harga yang sangat tidak terduga dan bergejolak.', 'Harga menunjukkan tren kenaikan yang kuat dan konsisten dalam satu minggu dan satu bulan terakhir. Meskipun demikian, posisi harga saat ini masih lebih rendah dari rata-rata 90 hari, menyiratkan bahwa kenaikan ini mungkin merupakan pemulihan setelah periode harga yang lebih rendah dari rata-rata yang lebih tinggi.', -22.47, 'Harga Cabai Rawit Merah saat ini berada 22.47% di bawah rata-rata harga 90 hari terakhir. Ini menunjukkan bahwa meskipun harga sedang naik, rata-rata historis tiga bulan terakhir menunjukkan harga sempat berada di level yang jauh lebih tinggi.', 'SANGAT TINGGI', 'Coefficient of Variation (CV) sebesar 34.45% menunjukkan bahwa harga Cabai Rawit Merah memiliki tingkat fluktuasi yang sangat besar relatif terhadap rata-ratanya. Angka CV ini sangat mendekati ambang batas volatilitas historis ekstrem (P95 sebesar 34.91%), mengindikasikan risiko pergerakan harga yang signifikan dalam waktu singkat.', 'KUAT', 'KONSISTEN', 'Dengan tren kenaikan yang kuat, harga Cabai Rawit Merah diperkirakan masih akan cenderung naik atau setidaknya tetap bergejolak dalam 1-7 hari ke depan, terutama jika belum ada intervensi pasar atau perbaikan kondisi pasokan.', 'Pola kenaikan harga dan volatilitas tinggi ini berpotensi berlanjut selama faktor-faktor pemicu (terutama cuaca dan ketersediaan pasokan) belum teratasi secara efektif, mengingat Cabai Rawit Merah adalah komoditas yang sangat responsif terhadap kondisi ini.', 'Analisis ini tidak mempertimbangkan faktor-faktor eksternal yang lebih luas seperti perubahan kebijakan nasional, kondisi ekonomi makro, atau pergerakan harga komoditas lain yang mungkin mempengaruhi daya beli dan harga Cabai Rawit Merah.', '2025-09-23 05:03:12', '2025-09-23 07:32:38'),
(36, 1653, 'VOLATIL', '2025-09-23', '2025-07-18', 'HIGH', 'EKSTREM', 60.70, 'NAIK', 'SIGNIFIKAN', 'Harga Bawang Merah saat ini Rp 48.000 berada di atas rentang Harga Acuan Penjualan (HAP) dan 31.55% di atas rata-rata harga 90 hari terakhir. Meskipun harga menunjukkan stabilitas dalam seminggu terakhir (0.00% perubahan), terjadi kenaikan signifikan 33.33% dalam sebulan, menandakan kondisi harga yang ekstrem tinggi setelah periode kenaikan yang tajam.', 'Harga Bawang Merah saat ini, Rp 48.000, berada jauh di atas rentang Harga Acuan Penjualan (HAP) yang ditetapkan Rp 36.500 - Rp 41.500, serta 31.55% lebih tinggi dari harga rata-rata 90 hari terakhir.', 'Setelah mengalami kenaikan tajam dalam sebulan terakhir, harga Bawang Merah menunjukkan pola stabil pada level tinggi Rp 48.000 selama 7 hari terakhir. Pola ini mengindikasikan bahwa harga telah mencapai suatu titik keseimbangan sementara setelah lonjakan signifikan.', 'Indeks volatilitas mencapai 60.70, yang tergolong TINGGI. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation sebesar 17.68%) telah mencapai lebih dari setengah dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (29.12%).', 'Meskipun tidak ada perubahan harga harian maupun mingguan yang terdeteksi, tren bulanan menunjukkan kenaikan harga yang sangat kuat sebesar 33.33%. Ini mengindikasikan adanya tekanan harga ke atas yang signifikan dalam periode sebelumnya, dan saat ini harga bertahan di puncaknya.', 31.55, 'Harga Bawang Merah saat ini Rp 48.000 berada 31.55% di atas harga rata-rata 90 hari terakhir (Rp 36.489), menunjukkan level harga yang jauh lebih tinggi dari kondisi normal dalam tiga bulan terakhir.', 'TINGGI', 'Nilai Coefficient of Variation (CV) sebesar 17.68% untuk komoditas volatil Bawang Merah menunjukkan fluktuasi harga yang cukup tinggi dibandingkan rata-ratanya dalam 90 hari terakhir, mendekati batas atas kategori \'Fluktuatif\' dan memberikan kontribusi pada indeks volatilitas yang tinggi.', 'KUAT', 'TIDAK_KONSISTEN', 'Meskipun harga stabil dalam 7 hari terakhir, tekanan dari kenaikan bulanan dan kondisi cuaca Pancaroba mengindikasikan potensi harga bertahan tinggi dalam jangka pendek atau bahkan berpotensi naik jika pasokan tidak membaik.', 'Pola harga yang stabil di level tinggi setelah kenaikan tajam menunjukkan bahwa pasar telah menyesuaikan diri dengan kondisi pasokan yang terbatas. Tanpa intervensi atau peningkatan pasokan, level harga ini mungkin berkelanjutan.', 'Analisis ini tidak secara spesifik mempertimbangkan faktor-faktor eksternal yang lebih luas seperti kebijakan impor nasional atau pergerakan harga komoditas lain yang saling terkait.', '2025-09-23 05:03:12', '2025-09-23 07:32:38'),
(37, 1650, 'VOLATIL', '2025-09-23', '2025-07-17', 'HIGH', 'BERGEJOLAK', 95.89, 'NAIK', 'SIGNIFIKAN', 'Harga Cabai Merah Keriting telah naik signifikan 10% dalam seminggu dan 83.33% dalam sebulan, mencapai batas atas Harga Acuan Penjualan (HAP) Rp 55.000. Tingkat fluktuasi harga saat ini sangat tinggi, mendekati ambang batas ekstrem historis.', 'Harga saat ini (Rp 55.000) berada tepat di batas atas Harga Acuan Penjualan (HAP) dan 19.90% di bawah rata-rata harga 90 hari terakhir, menunjukkan harga sedang dalam tren kenaikan kembali menuju level rata-rata jangka panjang setelah kemungkinan penurunan sebelumnya.', 'Teridentifikasi pola kenaikan harga yang kuat dalam sebulan terakhir, dengan dorongan signifikan dalam seminggu terakhir yang membawa harga ke titik HAP tertinggi. Pola ini juga disertai dengan volatilitas harga yang sangat tinggi.', 'Indeks volatilitas mencapai 95.89, yang tergolong SANGAT TINGGI. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation sebesar 32.28%) telah mendekati ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (33.67%).', 'Terdapat tren kenaikan harga yang konsisten dan kuat dalam jangka pendek (mingguan) dan menengah (bulanan). Kenaikan +10.00% mingguan mengonfirmasi keberlanjutan tren positif setelah kenaikan +83.33% bulanan.', -19.90, 'Harga saat ini (Rp 55.000) berada 19.90% di bawah rata-rata harga 90 hari terakhir (Rp 68.667). Ini mengindikasikan harga telah naik secara signifikan dari level terendah namun masih belum mencapai rata-rata jangka panjang, yang mungkin mencerminkan penurunan dari puncak harga yang sangat tinggi di masa lalu.', 'SANGAT_TINGGI', 'Indeks volatilitas mencapai 95.89, yang tergolong SANGAT TINGGI. Ini karena tingkat fluktuasi harga saat ini (CV 32.28%) telah mendekati ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (33.67%).', 'KUAT', 'KONSISTEN', 'Dengan kenaikan mingguan yang signifikan dan posisi harga di batas atas HAP, Cabai Merah Keriting berpotensi tetap tinggi atau bahkan mengalami kenaikan lebih lanjut dalam 1-7 hari ke depan, terutama jika faktor pendorong pasokan belum teratasi.', 'Tren kenaikan yang kuat dan tingkat volatilitas yang sangat tinggi menunjukkan pola ini dapat berkelanjutan, didukung oleh kerentanan komoditas terhadap konteks musiman pancaroba. Diperlukan tindakan proaktif untuk meredam potensi lonjakan harga.', 'Faktor-faktor eksternal yang lebih luas seperti perubahan kebijakan nasional, fluktuasi nilai tukar, atau perubahan drastis dalam perilaku permintaan konsumen di luar konteks HBKN, tidak dimasukkan secara mendalam dalam analisis ini.', '2025-09-23 05:03:12', '2025-09-23 07:32:38'),
(38, 1660, 'PENTING', '2025-09-23', '2025-07-17', 'HIGH', 'STABIL', 40.57, 'SIDEWAYS', 'NORMAL', 'Harga Daging Ayam Ras Karkas di Kabupaten Mempawah menunjukkan stabilitas sempurna dalam seminggu terakhir, berada sedikit di atas rata-rata 90 hari dan di bawah Harga Acuan Penjualan (HAP). Meskipun stabil saat ini, harga sempat mengalami penurunan 5.00% dalam sebulan terakhir.', 'Harga saat ini Rp 38.000 berada sedikit di atas rata-rata harga 90 hari (Rp 37.844) dan berada di bawah Harga Acuan Penjualan (HAP) sebesar Rp 40.000.', 'Harga Daging Ayam Ras Karkas telah stagnan pada Rp 38.000 selama 7 hari terakhir, menunjukkan tidak ada perubahan harian maupun mingguan. Namun, secara bulanan, komoditas ini telah mengalami penurunan harga sebesar 5.00%.', 'Indeks volatilitas mencapai 40.57, yang tergolong RENDAH. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation sebesar 4.06%) masih jauh di bawah ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (10.00%).', 'Dalam periode 7 hari terakhir, harga menunjukkan tren stagnan atau \'sideways\'. Akan tetapi, jika melihat jangka waktu bulanan, terdapat tren penurunan harga yang moderat.', 0.41, 'Harga saat ini hampir identik dengan rata-rata harga dalam 90 hari terakhir, mengindikasikan bahwa harga berada pada level keseimbangan historisnya.', 'RENDAH', 'Nilai Coefficient of Variation (CV) yang sangat rendah (4.06%) menunjukkan bahwa pergerakan harga Daging Ayam Ras Karkas sangat stabil dan tidak berfluktuasi secara signifikan dalam tiga bulan terakhir.', 'LEMAH', 'KONSISTEN', 'Harga Daging Ayam Ras Karkas diproyeksikan akan tetap stabil dalam 1-7 hari ke depan, mengingat tidak adanya perubahan harga dalam seminggu terakhir dan posisi yang dekat dengan rata-rata historisnya.', 'Pola harga yang stabil dan berada di bawah HAP dapat berlanjut jika pasokan tetap memadai dan biaya produksi tidak meningkat signifikan. Namun, potensi cuaca pancaroba perlu diwaspadai karena dapat mempengaruhi logistik dan distribusi.', 'Faktor eksternal seperti perubahan kebijakan pemerintah pusat terkait impor pakan atau subsidi energi, serta dinamika pasar regional di luar Kabupaten Mempawah, tidak dianalisis secara spesifik dalam laporan ini.', '2025-09-23 05:03:12', '2025-09-23 07:32:38'),
(39, 1660, 'PENTING', '2025-09-24', '2025-07-17', 'HIGH', 'STABIL', 40.57, 'SIDEWAYS', 'NORMAL', 'Harga Daging Ayam Ras Karkas,1 kg di Kabupaten Mempawah menunjukkan kondisi yang stabil pada Rp 38.000 per kilogram. Harga ini berada di bawah Harga Acuan Penjualan (HAP) nasional sebesar Rp 40.000, mengindikasikan pasokan yang cukup atau bahkan cenderung surplus di pasar.', 'Harga saat ini Rp 38.000 berada 0.41% di atas rata-rata harga 90 hari (Rp 37.844) namun tetap di bawah Harga Acuan Penjualan (HAP) nasional Rp 40.000. Posisi ini menunjukkan harga yang stabil dan terkontrol.', 'Selama 7 hari terakhir (hingga 17 Juli 2025), harga Daging Ayam Ras Karkas,1 kg tetap konsisten pada Rp 38.000. Meskipun stabil di minggu terakhir, ada indikasi penurunan sebesar 5.00% dalam sebulan terakhir, menunjukkan harga telah mencapai titik stabil setelah koreksi.', 'Indeks volatilitas mencapai 40.57, yang tergolong RENDAH. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation 4.06%) hanya mencapai sekitar empat puluh persen dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (10.00%). Hal ini menunjukkan harga saat ini sangat stabil dan tidak menunjukkan gejolak yang signifikan.', 'Dalam jangka pendek (harian dan mingguan), harga menunjukkan tren stabil atau SIDEWAYS, tanpa pergerakan signifikan. Namun, dalam jangka bulanan, terdapat sedikit tren penurunan (-5.00%), yang mengindikasikan harga telah terkoreksi ke bawah sebelum mencapai stabilitas saat ini.', 0.41, 'Harga saat ini sedikit lebih tinggi dari rata-rata 90 hari, namun masih dalam rentang fluktuasi yang sangat normal dan menunjukkan stabilitas pasar.', 'RENDAH', 'Dengan Coefficient of Variation sebesar 4.06%, tingkat fluktuasi harga Daging Ayam Ras Karkas,1 kg saat ini sangat rendah. Angka ini jauh di bawah ambang batas volatilitas historis (P95) sebesar 10.00%, menegaskan kondisi pasar yang sangat tenang dan stabil.', 'LEMAH', 'KONSISTEN', 'Harga Daging Ayam Ras Karkas,1 kg diperkirakan akan tetap stabil dalam 1-7 hari ke depan, mengingat tidak ada perubahan harian maupun mingguan yang signifikan dalam data terbaru.', 'Pola stabilitas harga ini kemungkinan akan berkelanjutan dalam waktu dekat, terutama karena tidak ada Hari Besar Keagamaan Nasional (HBKN) yang terdekat. Namun, keberlanjutan jangka panjang akan bergantung pada keseimbangan biaya produksi dan pasokan.', 'Faktor eksternal seperti perubahan kebijakan pemerintah pusat terkait subsidi pakan, isu kesehatan hewan berskala nasional (misalnya wabah), atau fluktuasi nilai tukar yang memengaruhi harga impor bahan baku pakan, tidak dianalisis secara spesifik dalam laporan ini karena keterbatasan data yang diberikan.', '2025-09-24 03:17:47', '2025-09-24 05:02:45'),
(40, 1661, 'PENTING', '2025-09-24', '2025-07-18', 'MEDIUM', 'FLUKTUATIF', 76.04, 'NAIK', 'SIGNIFIKAN', 'Harga Telur Ayam Ras menunjukkan kenaikan mingguan sebesar 3.33% dan saat ini berada di Rp 31.000, melampaui Harga Acuan Penjualan (HAP) sebesar Rp 30.000. Tingkat volatilitas harga juga tergolong tinggi, menunjukkan adanya pergerakan harga yang perlu diwaspadai.', 'Harga saat ini (Rp 31.000) berada di atas Harga Acuan Penjualan (HAP) nasional sebesar Rp 30.000 dan 2.72% di atas rata-rata harga 90 hari terakhir.', 'Setelah periode harga stabil di Rp 30.000, harga menunjukkan kenaikan mendadak ke Rp 31.000 pada pertengahan minggu lalu dan bertahan di level tersebut hingga data terakhir. Pola ini mengindikasikan adanya pergeseran ke level harga yang lebih tinggi.', 'Indeks volatilitas mencapai 76.04, yang tergolong TINGGI. Ini karena tingkat fluktuasi harga saat ini (CV 3.80%) telah mencapai lebih dari tiga perempat dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (5.00%).', 'Tren harga mingguan menunjukkan kenaikan sebesar 3.33%. Dalam tujuh hari terakhir, harga stabil di Rp 30.000 sebelum naik menjadi Rp 31.000 dan kemudian stabil di level tersebut, menunjukkan tren kenaikan yang konsisten dalam jangka pendek.', 2.72, 'Harga saat ini sedikit di atas rata-rata harga 90 hari terakhir, mengindikasikan bahwa level harga Rp 31.000 mulai menjadi norma baru, melampaui rata-rata historis jangka pendek.', 'TINGGI', 'Nilai Coefficient of Variation (CV) sebesar 3.80% menunjukkan bahwa fluktuasi harga Telur Ayam Ras relatif signifikan, mendekati ambang batas volatilitas historis, mengkonfirmasi level volatilitas TINGGI.', 'SEDANG', 'KONSISTEN', 'Melihat tren stabilisasi di level harga Rp 31.000 dalam beberapa hari terakhir, diperkirakan harga akan tetap berada di kisaran ini dalam 1-7 hari ke depan, dengan potensi fluktuasi kecil. Namun, posisi di atas HAP tetap menjadi perhatian.', 'Jika tidak ada intervensi atau perubahan signifikan pada faktor biaya produksi/permintaan, pola harga yang stabil di atas HAP ini berpotensi berkelanjutan dalam jangka menengah, mengindikasikan normalisasi harga di level yang lebih tinggi dari HAP.', 'Analisis ini tidak secara spesifik mempertimbangkan faktor eksternal non-ekonomi (misalnya: kebijakan nasional baru, perubahan regulasi impor) yang mungkin memengaruhi harga secara signifikan.', '2025-09-24 03:17:47', '2025-09-24 05:02:45'),
(41, 1644, 'POKOK', '2025-09-24', '2025-07-18', 'HIGH', 'STABIL', 28.81, 'SIDEWAYS', 'NORMAL', 'Harga Beras Cap Burung Hong (Medium) di Kabupaten Mempawah menunjukkan stabilitas sempurna dalam satu minggu terakhir, bahkan satu bulan terakhir, bertahan di Rp 14.000. Harga saat ini sedikit di bawah rata-rata 90 hari dan tingkat volatilitas sangat rendah.', 'Harga saat ini Rp 14.000, berada sedikit di bawah rata-rata harga 90 hari terakhir (Rp 14.222), mengindikasikan posisi yang cenderung lebih rendah dari rata-rata jangka menengah dan memberikan kepastian harga bagi konsumen.', 'Data menunjukkan pola harga yang sangat stabil dan konsisten. Tidak ada pergerakan harga yang terdeteksi secara harian, mingguan, maupun bulanan, mencerminkan kondisi pasar yang tenang untuk komoditas ini.', 'Indeks volatilitas mencapai 28.81, yang tergolong RENDAH. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation 1.76%) hanya mencapai kurang dari sepertiga dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (6.10%).', 'Tren harga Beras Cap Burung Hong (Medium) saat ini adalah \'SIDEWAYS\' atau datar. Tidak ada indikasi kenaikan atau penurunan yang signifikan, menunjukkan kondisi pasar yang seimbang antara permintaan dan penawaran dalam periode yang diamati.', -1.56, 'Harga saat ini Rp 14.000, sedikit lebih rendah sebesar 1.56% dari rata-rata harga 90 hari terakhir yang sebesar Rp 14.222. Ini menunjukkan harga berada di bawah level rata-rata jangka menengah.', 'RENDAH', 'Nilai Coefficient of Variation (CV) sebesar 1.76% sangat rendah, mengindikasikan fluktuasi harga yang minimal dan konsistensi harga yang tinggi dalam 90 hari terakhir. Ini adalah kondisi yang ideal untuk stabilitas harga.', 'LEMAH', 'KONSISTEN', 'Dalam 1-7 hari ke depan, diperkirakan harga Beras Cap Burung Hong (Medium) akan tetap stabil, melanjutkan tren konsisten yang sudah berlangsung, mengingat tidak adanya sinyal perubahan yang kuat dari data harga saat ini.', 'Pola stabilitas harga ini menunjukkan keberlanjutan dalam jangka pendek. Namun, keberlanjutan jangka panjang akan sangat bergantung pada faktor-faktor eksternal seperti musim panen berikutnya, kebijakan pangan nasional, dan kondisi cuaca ekstrem.', 'Analisis ini fokus pada pola harga internal dan konteks lokal. Faktor eksternal yang lebih luas seperti kebijakan impor/ekspor nasional atau perubahan harga komoditas global tidak dianalisis secara mendalam.', '2025-09-24 03:17:47', '2025-09-24 05:02:45'),
(42, 1653, 'VOLATIL', '2025-09-24', '2025-07-18', 'LOW', 'EKSTREM', 104.20, 'SIDEWAYS', 'SIGNIFIKAN', 'Berdasarkan data harga terakhir hingga 18 Juli 2025, harga Bawang Merah,1 kg di Kabupaten Mempawah tercatat Rp 48.000. Harga ini berada 31.55% di atas rata-rata 90 hari dan melampaui rentang Harga Acuan Penjualan (HAP) Rp 36.500 - Rp 41.500, meskipun stabil dalam seminggu terakhir pada periode tersebut.', 'Pada periode data terakhir (hingga 18 Juli 2025), harga Bawang Merah,1 kg berada di level Rp 48.000, yang merupakan 31.55% lebih tinggi dari rata-rata harga 90 hari (Rp 36.489) dan mendekati harga tertinggi dalam 90 hari (Rp 52.000). Harga ini juga secara signifikan berada di atas rentang Harga Acuan Penjualan (HAP).', 'Data menunjukkan bahwa harga Bawang Merah,1 kg mengalami kenaikan tajam sebesar 33.33% dalam sebulan terakhir yang berakhir pada 18 Juli 2025, dan kemudian stabil pada level tinggi tersebut dalam seminggu terakhir pada periode yang sama.', 'Indeks volatilitas mencapai 104.20, yang tergolong SANGAT TINGGI. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation/CV 17.68%) telah melampaui ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (Ambang Batas Volatilitas Historis P95 sebesar 16.96%).', 'Meskipun data terakhir menunjukkan harga stabil dalam seminggu hingga 18 Juli 2025, tren bulanan pada periode yang sama mengindikasikan kenaikan harga yang sangat kuat dan signifikan, dengan harga yang konsisten berada di atas rata-rata 90 hari.', 31.55, 'Pada periode data terakhir, harga Bawang Merah jauh di atas rata-rata historis 90 hari, menunjukkan anomali harga yang signifikan dan berada pada level yang tidak wajar.', 'SANGAT_TINGGI', 'Nilai Coefficient of Variation (CV) sebesar 17.68% menunjukkan bahwa harga Bawang Merah pada periode data terakhir berfluktuasi pada tingkat yang lebih tinggi dari normal, bahkan melebihi ambang batas historis P95 (16.96%), mengindikasikan risiko pergerakan harga yang cepat.', 'KUAT', 'KONSISTEN', 'Berdasarkan pola historis hingga Juli 2025, jika kondisi pasokan dan distribusi tidak membaik, harga diperkirakan akan tetap stabil pada level tinggi atau bahkan berpotensi naik jika gangguan cuaca pancaroba yang terus berlanjut berdampak pada pasokan saat ini.', 'Pola kenaikan harga yang diikuti oleh stabilisasi pada level tinggi ini dapat berlanjut jika tidak ada intervensi yang berarti atau perbaikan pasokan yang signifikan di bulan-bulan mendatang.', 'Faktor eksternal seperti perubahan kebijakan perdagangan nasional, subsidi, atau bencana alam besar yang spesifik untuk Bawang Merah di luar konteks cuaca lokal tidak dianalisis secara spesifik dalam laporan ini.', '2025-09-24 03:17:47', '2025-09-24 05:02:45'),
(43, 1654, 'POKOK', '2025-09-24', '2025-07-17', 'HIGH', 'STABIL', 47.88, 'SIDEWAYS', 'NORMAL', 'Harga Gula Pasir Curah di Kabupaten Mempawah terpantau stabil pada Rp 17.000, tanpa adanya perubahan harga dalam seminggu terakhir. Harga ini juga merupakan titik terendah dalam 90 hari terakhir dan berada 4.32% di bawah harga rata-rata bulanan.', 'Harga Gula Pasir Curah saat ini berada pada Rp 17.000, yang merupakan harga terendah dalam 90 hari terakhir dan 4.32% di bawah harga rata-rata periode tersebut.', 'Harga komoditas ini menunjukkan pola stabilitas yang sangat kuat dalam seminggu terakhir, tidak bergerak sama sekali. Namun, jika dilihat dari tren bulanan, harga telah mengalami penurunan sebesar 5.56%.', 'Indeks volatilitas mencapai 47.88, yang tergolong SEDANG. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation sebesar 2.39%) telah mencapai kurang dari setengah dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (5.00%). Secara umum, volatilitas harga gula pasir curah relatif rendah.', 'Harga komoditas ini menunjukkan tren penurunan sebesar 5.56% dalam sebulan terakhir. Meskipun demikian, dalam seminggu terakhir, harga telah mencapai titik stabil dan tidak menunjukkan pergerakan.', -4.32, 'Harga saat ini Rp 17.000 berada 4.32% di bawah rata-rata harga 90 hari (Rp 17.767), menunjukkan bahwa harga relatif lebih rendah dibandingkan kondisi bulanan normal.', 'RENDAH', 'Dengan Coefficient of Variation (CV) sebesar 2.39%, tingkat fluktuasi harga Gula Pasir Curah sangat rendah, menunjukkan stabilitas harga yang signifikan dalam 90 hari terakhir.', 'LEMAH', 'TIDAK_KONSISTEN', 'Dalam 1-7 hari ke depan, harga Gula Pasir Curah diperkirakan akan tetap STABIL pada level Rp 17.000, mengingat tidak ada pergerakan harga signifikan dalam seminggu terakhir.', 'Pola harga yang stabil rendah ini cenderung berkelanjutan selama tidak ada gangguan besar pada rantai pasok atau perubahan kebijakan yang mendasarinya. Tren bulanan menurun menunjukkan pasokan yang cukup stabil.', 'Analisis ini tidak secara spesifik mempertimbangkan dampak penuh dari kebijakan perdagangan nasional, perubahan harga bahan baku internasional yang mendadak, atau gangguan logistik besar yang mungkin tidak tercermin dalam data harga lokal.', '2025-09-24 03:17:47', '2025-09-24 05:02:45'),
(44, 1647, 'POKOK', '2025-09-25', '2025-09-25', 'HIGH', 'BERGEJOLAK', 64.74, 'TURUN', 'SIGNIFIKAN', 'Harga Beras Cap Madu Tupai (Premium) mengalami penurunan mingguan yang signifikan sebesar -5.88% dan saat ini berada pada Rp 16.000, merupakan harga terendah dalam 90 hari terakhir. Indeks volatilitas berada pada level 64.74, menunjukkan fluktuasi yang cukup tinggi mendekati ambang batas ekstrem historis.', 'Harga saat ini (Rp 16.000) adalah harga terendah dalam 90 hari terakhir dan berada sedikit di bawah rata-rata harga 90 hari (-1.54%).', 'Setelah periode stabilitas di harga Rp 17.000 selama beberapa hari (termasuk seminggu terakhir), harga mengalami penurunan tajam pada hari terakhir pemantauan, mencapai titik terendah dalam tiga bulan terakhir.', 'Indeks volatilitas mencapai 64.74, yang tergolong MODERATELY TINGGI. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation 3.27%) telah mencapai lebih dari dua pertiga dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (5.05%).', 'Harga menunjukkan tren penurunan yang signifikan dalam seminggu terakhir setelah periode yang relatif stabil. Penurunan ini cukup mencolok karena membawa harga ke level terendah dalam periode 90 hari.', -1.54, 'Harga saat ini sedikit di bawah rata-rata 90 hari, mengindikasikan pergeseran ke arah level harga yang lebih rendah dari biasanya.', 'SEDANG', 'Nilai Coefficient of Variation (3.27%) menunjukkan fluktuasi harga saat ini tergolong sedang. Namun, dengan Indeks Volatilitas 64.74, ini mengindikasikan bahwa volatilitas pasar berada pada tingkat yang perlu diperhatikan, mendekati ambang batas ekstrem historisnya.', 'KUAT', 'KONSISTEN', 'Melihat penurunan tajam baru-baru ini, harga Beras Cap Madu Tupai (Premium) kemungkinan akan mencoba mencari titik stabil baru dalam 1-7 hari ke depan. Ada potensi untuk sedikit koreksi naik atau stabilisasi pada level rendah saat ini, tergantung pada dinamika pasokan yang masuk.', 'Keberlanjutan tren penurunan ini sangat bergantung pada faktor pasokan dan permintaan yang mendasarinya, serta potensi adanya intervensi pasar. Volatilitas yang mendekati ambang batas ekstrem menunjukkan bahwa pergerakan harga yang cepat dapat terjadi dalam waktu singkat.', 'Faktor eksternal yang lebih luas seperti kebijakan perdagangan internasional, subsidi pertanian nasional, atau bencana alam skala besar di sentra produksi utama tidak secara eksplisit dianalisis dalam konteks data ini.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(45, 1660, 'PENTING', '2025-09-25', '2025-09-25', 'HIGH', 'BERGEJOLAK', 80.30, 'NAIK', 'SIGNIFIKAN', 'Harga Daging Ayam Ras Karkas di Kabupaten Mempawah mengalami kenaikan mingguan signifikan sebesar 5.26%, mencapai Rp 40.000. Harga saat ini berada persis di Harga Acuan Penjualan (HAP) Nasional, menandakan bahwa harga telah mencapai batas atas yang wajar. Tingkat volatilitas juga tergolong tinggi, menunjukkan pasar yang lebih sensitif terhadap perubahan.', 'Harga saat ini Rp 40.000 berada 5.54% di atas rata-rata harga 90 hari terakhir (Rp 37.900) dan setara dengan harga tertinggi yang tercatat dalam periode tersebut. Posisi harga yang tepat berada di HAP menandakan potensi tekanan harga.', 'Setelah periode relatif stabil di Rp 38.000, harga menunjukkan lonjakan signifikan menjadi Rp 40.000 pada pertengahan minggu (22/9/2025) dan bertahan stabil di level yang lebih tinggi ini hingga saat analisis, mengindikasikan pembentukan harga dasar baru.', 'Indeks volatilitas mencapai 80.30, yang tergolong TINGGI. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation sebesar 4.02%) telah mencapai lebih dari tiga perempat dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (5.00%). Ini menunjukkan bahwa pergerakan harga saat ini tidak biasa dibandingkan kebiasaan sebelumnya.', 'Tren mingguan menunjukkan kenaikan yang kuat dan cepat sebesar 5.26%, yang didorong oleh lonjakan harga tunggal diikuti oleh konsolidasi di level yang lebih tinggi. Ini bukan kenaikan bertahap melainkan pergeseran harga yang signifikan.', 5.54, 'Harga saat ini Rp 40.000 berada 5.54% di atas rata-rata harga 90 hari terakhir (Rp 37.900), menunjukkan pergeseran harga ke level yang lebih tinggi dari kebiasaan historis.', 'TINGGI', 'Dengan Coefficient of Variation (CV) sebesar 4.02% yang mendekati ambang batas volatilitas historis 5.00%, ini menunjukkan adanya peningkatan fluktuasi harga yang signifikan dibandingkan periode sebelumnya, meskipun dalam skala absolut masih tergolong moderat.', 'KUAT', 'KONSISTEN', 'Dalam 1-7 hari ke depan, harga Daging Ayam Ras Karkas cenderung akan tetap stabil di Rp 40.000 atau HAP, mengingat telah bertahan di level tersebut selama beberapa hari terakhir. Namun, tekanan kenaikan lanjutan tetap ada jika faktor pemicu (biaya/pasokan) tidak tertangani.', 'Pola kenaikan harga yang tiba-tiba dan stabil di level tinggi ini dapat berkelanjutan jika tidak ada intervensi atau jika faktor penyebab (misalnya, biaya produksi yang tinggi) terus berlanjut. Ini mengindikasikan pembentukan harga eceran baru.', 'Analisis ini tidak memperhitungkan secara spesifik faktor eksternal makroekonomi (misalnya, perubahan nilai tukar yang memengaruhi harga pakan impor) atau kebijakan nasional yang mungkin memengaruhi harga komoditas ini.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(46, 1644, 'POKOK', '2025-09-25', '2025-09-25', 'HIGH', 'FLUKTUATIF', 39.45, 'TURUN', 'SIGNIFIKAN', 'Harga Beras Cap Burung Hong (Medium) mengalami penurunan sebesar 3.45% dalam seminggu terakhir, mencapai Rp 14.000. Harga ini sedikit berada di bawah rata-rata 90 hari (-1.10%) dan menempatkan kondisi harga dalam kategori FLUKTUATIF.', 'Harga saat ini berada di level Rp 14.000, sedikit lebih rendah (-1.10%) dari rata-rata harga dalam 90 hari terakhir (Rp 14.156).', 'Teridentifikasi pola harga stabil di Rp 14.500 selama enam hari berturut-turut, diikuti oleh penurunan tajam pada hari terakhir analisis menjadi Rp 14.000.', 'Indeks volatilitas mencapai 39.45, yang tergolong SEDANG. Ini karena tingkat fluktuasi harga saat ini (CV 2.41%) berada pada level moderat, hanya mencapai kurang dari setengah dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (6.10%).', 'Dalam seminggu terakhir terjadi penurunan harga yang signifikan sebesar 3.45% setelah periode relatif stabil. Namun, secara bulanan harga masih menunjukkan perubahan 0.00%, mengindikasikan bahwa penurunan ini adalah fenomena yang baru terjadi di akhir periode.', -1.10, 'Harga saat ini Rp 14.000, sedikit di bawah rata-rata harga dalam 90 hari terakhir, yang mengindikasikan posisi yang cenderung lebih murah dari biasanya dalam jangka pendek.', 'SEDANG', 'Tingkat fluktuasi harga saat ini (Coefficient of Variation 2.41%) menunjukkan bahwa pergerakan harga relatif moderat dan masih jauh di bawah ambang batas volatilitas ekstrem historis (6.10%).', 'SEDANG', 'TIDAK_KONSISTEN', 'Dengan penurunan harga yang signifikan baru-baru ini, terdapat indikasi bahwa harga Beras Cap Burung Hong (Medium) akan cenderung stabil atau bahkan melanjutkan tren penurunan dalam 1-7 hari ke depan, mencapai level harga yang lebih rendah.', 'Penurunan harga yang mendadak setelah periode stabil memerlukan pemantauan lebih lanjut untuk memastikan apakah ini adalah perubahan tren yang berkelanjutan atau fluktuasi sesaat yang dapat berbalik arah.', 'Faktor-faktor eksternal seperti kebijakan harga beras nasional, dampak iklim El Nino/La Nina yang lebih luas, dan perubahan harga komoditas global tidak dianalisis secara mendalam dalam laporan ini.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(47, 1661, 'PENTING', '2025-09-25', '2025-09-25', 'HIGH', 'FLUKTUATIF', 88.07, 'TURUN', 'SIGNIFIKAN', 'Harga Telur Ayam Ras di Kabupaten Mempawah menunjukkan tren penurunan mingguan sebesar -3.45% dan bulanan sebesar -12.50%, mencapai level terendah Rp 28.000 dalam 90 hari terakhir. Harga ini berada DI BAWAH Harga Acuan Penjualan (HAP) sebesar Rp 30.000. Meskipun harga terus menurun, indeks volatilitas mencapai 88.07, menunjukkan bahwa pasar tetap sensitif terhadap perubahan mendadak meskipun trennya jelas.', 'Harga saat ini (Rp 28.000) adalah harga terendah dalam periode 90 hari terakhir dan 8.93% di bawah harga rata-rata 90 hari, serta berada di bawah Harga Acuan Penjualan (HAP) Rp 30.000.', 'Teridentifikasi pola penurunan harga yang konsisten dalam seminggu terakhir, mencapai titik harga terendah baru. Penurunan ini juga signifikan secara bulanan, menunjukkan tren jangka menengah yang kuat.', 'Indeks volatilitas mencapai 88.07, yang tergolong TINGGI. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation 4.40%) telah mencapai hampir 90% dari ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (P95 5.00%). Hal ini menunjukkan bahwa meskipun harga sedang turun, pasar tetap memiliki potensi gejolak.', 'Tren harga menunjukkan penurunan yang konsisten dan signifikan. Penurunan sebesar -3.45% secara mingguan dan -12.50% secara bulanan mengindikasikan arah pasar yang jelas ke bawah.', -8.93, 'Harga saat ini 8.93% di bawah harga rata-rata 90 hari, menunjukkan penurunan yang signifikan dari rata-rata jangka menengah dan potensi tekanan pada sisi produsen.', 'TINGGI', 'Tingkat fluktuasi harga saat ini (CV 4.40%) sangat mendekati ambang batas volatilitas ekstrem historis (P95 5.00%), mengindikasikan bahwa pergerakan harga saat ini tergolong signifikan dan perlu diwaspadai, meskipun arahnya ke bawah.', 'KUAT', 'KONSISTEN', 'Melihat tren mingguan dan bulanan yang menurun konsisten serta harga yang stabil di Rp 28.000 selama beberapa hari terakhir, diperkirakan harga akan tetap rendah atau bahkan melanjutkan penurunan kecil dalam 1-7 hari ke depan, kecuali ada perubahan signifikan pada sisi pasokan atau permintaan yang mendadak.', 'Tren penurunan harga yang cukup kuat dalam sebulan terakhir, serta posisi harga yang stabil di bawah HAP, mengindikasikan bahwa pola harga rendah ini mungkin akan berkelanjutan dalam jangka pendek hingga menengah, terutama jika pasokan tetap melimpah atau biaya produksi terkendali di tingkat peternak.', 'Faktor eksternal yang lebih luas seperti kebijakan nasional terkait impor pakan, kondisi ekonomi makro secara umum, atau kebijakan subsidi pemerintah yang bersifat nasional tidak dianalisis secara mendalam dalam konteks TPID daerah ini.', '2025-09-25 03:12:12', '2025-09-25 03:12:12'),
(48, 1645, 'POKOK', '2025-09-25', '2025-09-25', 'MEDIUM', 'FLUKTUATIF', 36.80, 'TURUN', 'SIGNIFIKAN', 'Harga Beras Cap Anggrek (Medium) di Kabupaten Mempawah mengalami penurunan signifikan sebesar 3.45% dalam seminggu terakhir. Penurunan ini menempatkan harga pada kategori fluktuatif, mendekati titik terendah dalam 90 hari terakhir dan sedikit di bawah rata-rata harga periode tersebut. Meskipun terjadi penurunan harga, tingkat volatilitasnya masih tergolong sedang, menunjukkan fluktuasi harga belum mencapai level ekstrem secara historis.', 'Harga saat ini Rp 14.000, berada pada titik terendah dalam 90 hari terakhir dan 1.10% di bawah rata-rata harga periode tersebut. Hal ini mengindikasikan adanya koreksi harga ke bawah setelah periode stabil sebelumnya.', 'Teridentifikasi pola stabilisasi harga pada kisaran Rp 14.500 selama enam hari berturut-turut, diikuti oleh penurunan tajam ke Rp 14.000 pada hari terakhir. Pola ini menunjukkan adanya perubahan signifikan dalam dinamika pasar beras minggu ini.', 'Indeks volatilitas mencapai 36.80, yang tergolong SEDANG. Ini karena tingkat fluktuasi harga saat ini (Coefficient of Variation sebesar 2.41%) masih relatif jauh di bawah ambang batas volatilitas ekstrem yang secara historis jarang terjadi untuk komoditas ini (6.54%). Dengan demikian, meskipun terjadi perubahan harga, tingkat goncangan harga masih dalam batas terkendali.', 'Terdapat tren penurunan yang jelas dalam seminggu terakhir (-3.45%). Namun, secara bulanan, harga masih menunjukkan stagnasi (0.00%), mengindikasikan bahwa penurunan signifikan ini baru terjadi di akhir periode. Posisi harga saat ini yang berada di bawah rata-rata 90 hari memperkuat indikasi tren koreksi harga.', -1.10, 'Harga saat ini Rp 14.000 berada 1.10% di bawah rata-rata harga 90 hari (Rp 14.156). Hal ini menunjukkan harga telah bergerak ke level yang lebih rendah dari rata-rata historis dalam jangka pendek.', 'SEDANG', 'Dengan Coefficient of Variation (CV) sebesar 2.41%, volatilitas harga Beras Cap Anggrek (Medium) berada pada level sedang. Ini menunjukkan bahwa meskipun ada perubahan harga, fluktuasinya masih relatif stabil dan tidak terlalu ekstrem dibandingkan ambang batas historis.', 'SEDANG', 'TIDAK_KONSISTEN', 'Mengingat harga saat ini berada pada titik terendah 90 hari dan adanya penurunan tajam, ada kemungkinan harga akan stabil di level ini atau mengalami koreksi kecil ke atas dalam 1-7 hari ke depan jika pasokan mulai menyesuaikan dengan permintaan. Namun, tren penurunan yang baru terjadi mengindikasikan potensi harga tetap rendah dalam waktu dekat.', 'Pola penurunan signifikan ini tidak konsisten dengan periode stabil sebelumnya, sehingga keberlanjutannya perlu dipantau secara ketat. Jika didorong oleh faktor fundamental seperti melimpahnya pasokan, penurunan ini mungkin akan bertahan lebih lama, namun jika hanya koreksi pasar, harga dapat kembali bergerak naik.', 'Analisis ini tidak secara langsung mengintegrasikan faktor eksternal yang lebih luas seperti kebijakan subsidi pupuk nasional, fluktuasi harga energi, atau isu global yang dapat mempengaruhi biaya produksi dan distribusi beras.', '2025-09-25 03:12:12', '2025-09-25 03:12:12');
